(163, 0, 0, 0, '0', '', '', '', 0, 0, 0, 1360763766, 0),
(710, 744, 45, 1837, '0', '<p>Under 2012 erbjuder Drivhuset riktade insatser f&ouml;r dig som &auml;r kvinna och vill starta&nbsp;f&ouml;retag, eller utveckla ett redan befintligt&nbsp;f&ouml;retag. <br />N&auml;r det g&auml;ller starta f&ouml;retag vill vi&nbsp;s&auml;rskilt n&aring; kvinnliga studenter vid institutionen f&ouml;r humaniora samt institutionen f&ouml;r&nbsp;juridik, psykologi och socialt arbete.</p>\r\n<p>&nbsp;</p>\r\n<p>Drivhuset &auml;r en plattform f&ouml;r dig som vill utveckla entrepren&ouml;riellt driv. Genom personlig evolution och aff&auml;rsutveckling vill vi f&aring; fler att skapa nytt av sina id&eacute;er. Drivhuset arbetar h&ouml;gskolen&auml;ra &ouml;ver hela landet. Resultatet &auml;r livskraftiga f&ouml;retag som &auml;r redo f&ouml;r framtiden. Drivhusets mission &auml;r att skapa kreativ kraft, s&aring; att m&auml;nniskor kan starta, driva och utveckla f&ouml;retag. Genom personlig evolution och aff&auml;rsutveckling vill vi helt enkelt f&aring; fler att skapa n&aring;got nytt av sina id&eacute;er. Fokus ligger p&aring; dig som entrepren&ouml;r inte p&aring; id&eacute;n, f&ouml;r id&eacute;er bed&ouml;mer vi aldrig. M&aring;let &auml;r att du som entrepren&ouml;r och f&ouml;retagare f&aring;r de verktyg som beh&ouml;vs f&ouml;r att n&aring; dit du vill. D&auml;rf&ouml;r finns vi som ett bollplank &aring;t dig. Av oss kan du f&aring; v&auml;gledning, utbildning och tillg&aring;ng till en kontorsmilj&ouml;, allt utifr&aring;n ditt eget behov.</p>', 'Kontaktsamtal', 'Anländer strax efter 07.30', 0, 0, 0, 1369056931, 0),
