(2037, 549, 80, 3539, '0', '<p><strong>JOING Inwest &auml;r ett av de mest expansiva f&ouml;retagen inom ambulerande handel just nu.</strong></p>\r\n<p>N&auml;r &ouml;vriga f&ouml;retag minskar eller l&auml;gger ner sin verksamheten satsar vi och expanderar.<br />V&aring;r verksamhet bedrivs p&aring; festivaler, marknader m&auml;ssor och &ouml;vriga evenemang.<br /><br />Folieballonger &auml;r vi marknadsledande p&aring; inom Sverige. Vi har det st&ouml;rsta ambulerande sortimentet av folieballonger i Norden.</p>\r\n<p>Leksakerna vi s&auml;ljer &auml;r godk&auml;nda enligt TOMERs riktlinjer och konsument verkets alla krav.<br />Det nyaste omr&aring;det inom f&ouml;retaget &auml;r godisbiten. Detta omr&aring;de&nbsp;satsade vi&nbsp; p&aring;&nbsp;2013 genom att k&ouml;pa upp BJ:s konfektyr.</p>\r\n<p>&nbsp;</p>\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><img src="http://i.imgur.com/Gq7r3Jp.jpg?1" alt="" width="340" height="195" /></p>\r\n</td>\r\n<td>\r\n<p><img src="http://i.imgur.com/9CnYCAm.jpg?1" alt="" width="340" height="195" /></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Leksaker, ballonger, vindlekar/vindspel.', '', 0, 0, 0, 1391015444, 1397143670),
