(2082, 655, 80, 3334, '0', 'I Säljebacka, några kilometer söder om Västra Ämtervik, ligger gården Hagen naturskönt placerad mellan Frykstahöjden och Fryken. Där, på Fryksdalens Fårfarm, lever familjen Lundgren med sina drygt 300 tackor och bedriver en KRAV-godkänd lammuppfödning.\r\n\r\nÅrligen föds mellan 500-600 lamm. Dessa föds varsamt upp på i huvudsak gräs och slaktas i ett närbeläget slakteri under lugna former vid 10-14 månaders ålder.\r\n\r\nFrom 2012 pågår också egen förädling av lamm- och fårkött i egen gårdschark. Försäljning sker i egen gårdsbutik. ', 'Färskt kött och chark från egenuppfödda får och lamm. Fårskinn. ', '\nÄr i behov extra el 220V/10A', 0, 0, 0, 1390675621, 0),
