(2148, 1145, 80, 3439, '0', '<h1><strong>Din mobilskal expert</strong></h1>\r\n<h1><strong>Vi &auml;r experten p&aring; mobilskal, vi har till 95% av alla mobiltelefon modeller, vi har &auml;ven ipad och tablet fodral samt pl&aring;nb&ouml;cker till olika mobiltelefoner. Det vi inte har i butiken tar vi hem till er.</strong><br /><strong>Hos oss kan du &auml;ven designa ditt eget mobilskal, din egen favorit bild eller text p&aring; ditt mobilskal. Bara fantasin s&auml;tter gr&auml;nserna.</strong><br /><strong>Vi levererar allt fraktfritt.</strong></h1>\r\n<p>&nbsp;</p>', 'Trycker direkt på mobilskal, t.ex. Din egen bild på mobilskal', '', 0, 0, 0, 1379002248, 1398323463),
