(2162, 1138, 80, 3418, '0', '<p><strong>Sportfiskeprodukter av h&ouml;g kvalitet, noga utvalda utifr&aring;n gedigna kunskaper om sportfiske.</strong> <br />Hos mig finner ni ett fullsortiment av det b&auml;sta p&aring; marknaden och till bra priser. <br /><em>V&auml;lkommen att tala fiske! h&auml;lsar G&ouml;ran Svensson</em></p>', 'Sportfiskeprodukter. Full sortering.', '', 0, 0, 0, 1390679678, 1398252300),
(2163, 741, 80, 3542, '0', 'Marknad/Mässa   4 sorters Lagrade hårdostar,rökt forbondekorv,pepparrökt fläskfile.Butik Drottninggatani Karlstad', '4 sorters lagrade hårdostar, rökt forbondekorv, pepparrökt fläskfilé. Butik Drottninggatan i Karlstad.', '', 0, 0, 0, 1391019094, 0),
