(2171, 1168, 80, 3343, '0', '<p>Om Nidingbane.</p>\r\n<p>Nidingbane &auml;r en del av f&ouml;retaget Brutala blommor som har funnits i ca 7 &aring;r. Vi reser runt stora delar av &aring;ret och medverkar p&aring; marknader samt m&auml;ssor f&ouml;r att visa upp och s&auml;lja historiska saker. Turn&eacute;lista.</p>\r\n<p>Vi har v&aring;r fysiska butik i &Ouml;rebro p&aring; Rostagatan 14 . Vi tillverkar &auml;ven eget l&auml;derhantverk p&aring; plats.<br />Flera g&aring;nger om &aring;ret s&aring; reser vi runt i Europa f&ouml;r att bes&ouml;ka smeder och testa olika kvalit&eacute;er p&aring; rustningar och vapen.</p>\r\n<p>Vi f&aring;r ofta specialbest&auml;llningar fr&aring;n t.ex museum eller TV-inspelningar, och f&ouml;r dessa, samt f&ouml;r vanliga kunder har vi v&auml;ldigt snabba leveranstider.</p>\r\n<p>Har du en bild eller en teckning p&aring; vapen, rustning eller i stort sett n&auml;stan vad som helst s&aring; kan vi ordna fram det mesta.<br /><br /></p>\r\n<p>Bes&ouml;k v&aring;r hemsida http://www.nidingbane.se</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Smide, medeltida rustningar, historiskt hantverk.', '', 0, 0, 0, 1379666958, 1398166809),
