(2543, 1171, 80, 3601, '0', '<p><strong>Service, Kontroll, V&auml;rmepumpar - Ring&nbsp;Mats Berglind 070-2244788</strong></p>\r\n<p><strong>N&auml;r bytte ni era filter sist?</strong><br />(En f&ouml;ruts&auml;ttning f&ouml;r att anl&auml;ggningen skall kunna fungera optimalt.)<br />Givetvis kan vi ombes&ouml;rja ett filterbyte, injustering och OVK-kontroll av er ventilationsanl&auml;ggning.<br />Vill ni ha en &auml;nnu bekv&auml;mare l&ouml;sning, kan vi erbjuda er ett serviceavtal p&aring; er anl&auml;ggning.<br />Vi utf&ouml;r &auml;ven helt nyinstallationer av ventilationsanl&auml;ggningar.</p>\r\n<p><strong>Luftv&auml;rmepumpar</strong><br />Vi har ett m&aring;ng&aring;rigt samarbete med Daikin luftv&auml;rmepumpar.<br />Visste ni att ni kan spara 50% av er uppv&auml;rmningskostnad genom att installera en luftv&auml;rmepump.<br />Ni kan &auml;ven f&aring; ROT-avdrag p&aring; upp till 50% av arbetskostnaden vid nyinstallation av en luftv&auml;rmepump.<br />Vi kan &auml;ven utf&ouml;ra service p&aring; er gamla luftv&auml;rmepump.</p>\r\n<p><strong>Fels&ouml;kning</strong><br />Fungerar er anl&auml;ggning d&aring;ligt, oj&auml;mn v&auml;rme, d&aring;lig luft, h&ouml;gljudda ventilationsljud?<br />Tveka inte p&aring; att kontakta oss f&ouml;r att f&aring; hj&auml;lp med fels&ouml;kning.</p>\r\n<p><strong>Har ni fj&auml;rrv&auml;rme i er fastighet? </strong>Vi har stor erfarenhet av nyinstallation och &auml;ven fels&ouml;kning och reparation av er befintliga anl&auml;ggning.</p>\r\n<p>&nbsp;</p>', 'Luftvärmepumpar Daikin. Ventilation, Service, Kontroll.', '', 0, 0, 0, 1394210985, 1398701110),
