(2707, 1400, 80, 4193, '0', '<p>Evenemang &amp; Marknadskalendern startade 1964 och har sedan dess hj&auml;lpt ambulerande f&ouml;rs&auml;ljare att kontakta marknadsarrang&ouml;rer runtom i Sverige.</p>\r\n<p>Kalendern &auml;r ett register &ouml;ver Tivoli, Festivaler, Karnevaler, Torgdagar, Kommuner, Turistbyr&aring;er, Hotell/Vandrarhem, M&auml;ssarrang&ouml;rer och Marknadsarrang&ouml;rer i Sverige.</p>\r\n<p>Marknadskalendern utkommer en g&aring;ng per &aring;r. Vi g&ouml;r v&aring;rt yttersta f&ouml;r att producera en s&aring; bra produkt som m&ouml;jligt.</p>', 'Sveriges enda kompletta register över marknader i Sverige. www.marknadskalendern.se', '', 0, 0, 0, 1396277786, 1396277873),
