(2729, 458, 80, 3345, '0', '<p><strong>Jafaris Group</strong> har varit verksam p&aring; marknaden i snart 20 &aring;r.<br />Det har gett oss otroligt mycket erfarenhet och bredd p&aring; marknaden.<br />V&aring;r verksamhet avser f&ouml;rs&auml;ljning av snabbmat och bageriprodukter fr&aring;n v&aring;ra moderna fordon.<br />Vi finns p&aring; m&aring;nga olika marknader, festivaler och m&auml;ssor. Inget sammanhang &auml;r f&ouml;r sm&aring;tt eller f&ouml;r stort f&ouml;r oss!<br />Jafaris str&auml;cker sig &ouml;ver hela Sverige och vi &auml;r k&auml;nda f&ouml;r v&aring;ra fina, fr&auml;scha vagnar och delikata bakverk. <br />Trevlig och professionell personal ser vi som en sj&auml;lvklarhet!<br />Till v&aring;r stora gl&auml;dje kommer v&aring;ra kunder tillbaka, &aring;r efter &aring;r.</p>\r\n<p><strong>V&auml;lkommen du ocks&aring;! </strong>h&auml;lsar Peter Al Jafari med personal<br />&nbsp;<img src="http://i.imgur.com/GiU1bVU.jpg" alt="" width="347" /></p>', 'munkar,slush,sockervadd,canderade äpple,mjukglass,läsk och kaffe /Endast Kebab,hamburgare,piroger,strips och läsk vid platsen vid marknads kontoret', '', 0, 0, 0, 1396868912, 1398321610),
