7" Name="Bibliography"/>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Normale Tabelle";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin:0cm;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:"Times New Roman","serif";}\r\n</style>\r\n<![endif]--></p>\r\n<p class="MsoNormal">Den goda korven har sitt huvudplats p&aring; torget i Nora.</p>\r\n<p class="MsoNormal">F&ouml;retaget bedriver en flyttbar matf&ouml;rs&auml;ljning. Varusortimentet best&aring;r &ouml;verv&auml;gande av tysk grillkorv. Specialiteter &auml;r:</p>\r\n<ul>\r\n<li>&bdquo;N&uuml;rnberger R&ouml;stbratwurst&ldquo;,</li>\r\n<li>&bdquo;Th&uuml;ringer R&ouml;stbratwurst&ldquo; och</li>\r\n<li>&bdquo;Currywurst"</li>\r\n</ul>\r\n<p>med surk&aring;l, potatismos eller tyskt br&ouml;d.</p>\r\n<p class="MsoNormal">Som drycker erbjuder vi tyskt kaffe och alkoholfria drycker.</p>\r\n<p class="MsoNormal">F&ouml;rs&auml;ljningsvagnen kan &auml;ven bokas f&ouml;r privata kalas och f&ouml;retagsevenemang.</p>\r\n<p class="MsoNormal">Smaklig m&aring;ltid &ouml;nskar</p>\r\n<p class="MsoNormal">Natalie och Burkhard</p>', 'Varusortimentet består övervägande av tysk grillkorv. Specialiteter är „Nürnberger Röstbratwurst“, „Thüringer Röstbratwurst“ och „Currywurst“ med surkål, potatismos eller tyskt bröd.Som drycker erbjuder vi tyskt kaffe och alkoholfria drycker t.ex. Cola, Fanta, Vatten, Red Bull.', '', 0, 0, 0, 1398283007, 1398284779),
(2827, 1307, 83, 4246, '0', '<p>Hej!</p>\r\n<p>Vi &ouml;ppnade v&aring;rat f&ouml;retag f&ouml;r 3 &aring;r sedan. Vi s&auml;ljer f&auml;rska och varma Franska Crepes och Munkar. Vi friterar och bakar dom p&aring; platsen direkt :) . Vi s&auml;ljer ochs&aring; Kaffe L&auml;sk Sluch Ice och Mjukglass,</p>\r\n<p>MVH</p>\r\n<p>SVENSK MUNK</p>', 'Franska crepes , Munkar ,Slush is.', '', 0, 0, 0, 1398283289, 1398284693),
