(40, 'confirm_mail', 'eng', 'Account verification for CFS', '<p>We have recieved your registration request for our service Chartbooker Fair System.</p>\r\n<p>To confirm your account, click here: <a href="$url">$url</a></p>\r\n<p>Best regards,<br />Chartbooker International</p>'),
