(42, 'confirm_mail', 'sv', 'Bekräftelse av konto i CFS', '<p>Vi har mottagit din registreringsf&ouml;rfr&aring;gan f&ouml;r v&aring;r service Chartbooker Fair System.</p>\r\n<p>F&ouml;r att bekr&auml;fta ditt konto, klicka h&auml;r: <a href="$url">$url</a></p>\r\n<p>Med b&auml;sta h&auml;lsning,<br />Chartbooker International</p>'),
(43, 'resend_details', 'de', 'Your user account', '<p>$name,</p>\r\n<p>Our support team has reset your password as requested by you.<br />You will find your login details below:</p>\r\n<p>Username: $alias<br />Password: $password</p>\r\n<p>You can change your password to another one through "My profile" -&gt; "Change password" in the main menu when you are logged in.</p>\r\n<p>Best regards</p>\r\n<p>Support team<br />Chartbooker International</p>'),
(44, 'resend_details', 'en', 'Login credentials for your CFS account', '<p>$name,</p>\r\n<p>Our support team has reset your password as requested by you.<br />You will find your login details below:</p>\r\n<p>Username: $alias<br />Password: $password</p>\r\n<p>You can change your password to another one through "My profile" -&gt; "Change password" in the main menu when you are logged in.</p>\r\n<p>Best regards</p>\r\n<p>Support team<br /><strong>Chartbooker International</strong></p>'),
(45, 'resend_details', 'eng', 'Login credentials for your CFS account', '<p>$name,</p>\r\n<p>Our support team has reset your password as requested by you.<br />You will find your login details below:</p>\r\n<p>Username: $alias<br />Password: $password</p>\r\n<p>You can change your password to another one through "My profile" -&gt; "Change password" in the main menu when you are logged in.</p>\r\n<p>Best regards</p>\r\n<p>Support team<br />Chartbooker International</p>'),
(46, 'resend_details', 'es', 'Login credentials for your CFS account', '<p>$name,</p>\r\n<p>Our support team has reset your password as requested by you.<br />You will find your login details below:</p>\r\n<p>Username: $alias<br />Password: $password</p>\r\n<p>You can change your password to another one through "My profile" -&gt; "Change password" in the main menu when you are logged in.</p>\r\n<p>Best regards</p>\r\n<p>Support team<br />Chartbooker International</p>'),
(47, 'resend_details', 'sv', 'Återställning av era kontouppgifter för CFS', '<p>$name,<br /><br />V&aring;rt support team har &aring;terst&auml;llt ditt l&ouml;senord p&aring; Er beg&auml;ran.</p>\r\n<p>Ni finner era inloggningsuppgifter nedan:<br /><br />Anv&auml;ndarnamn: $alias<br />L&ouml;senord: $password</p>\r\n<p>F&ouml;r att byta l&ouml;senordet till ett mer personligt g&aring;r ni in under "Min profil" -&gt; "Byt l&ouml;senord" i huvudmenyn n&auml;r ni &auml;r inloggade.</p>\r\n<p>Med v&auml;nliga h&auml;lsningar</p>\r\n<p>Supporten<br /><strong>Chartbooker International</strong></p>'),
(48, 'event_account', 'de', 'Login credentials for your CFS account', '<p>The $creator_accesslevel $creator_name has created an account for you on his/her event <a href="$url">$url</a></p>\r\n<p>Username: $alias<br />Password: $password</p>\r\n<p>Best regards</p>\r\n<p>Chartbooker International</p>'),
