(53, 'reservation_cancelled', 'de', 'Reservation cancelled', '<p>Dear user,</p>\r\n<p>We regret to inform you that your reservation has been cancelled by an administrator.</p>\r\n<p>Best regards,<br />Chartbooker International</p>'),
(54, 'reservation_cancelled', 'en', 'Reservation cancelled', '<p>Dear $cancelled_name,</p>\r\n<p>We regret to inform you that your reservation on the stand space <strong>$position_name</strong> on the event <strong>$event_name</strong> has been cancelled by an Admin at $edit_time<br /><br /></p>\r\n<p><strong>Comment from the Admin:</strong></p>\r\n<p>$comment</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(55, 'reservation_cancelled', 'eng', 'Reservation cancelled - $event_name', '<p>Dear $cancelled_name,</p>\r\n<p>We regret to inform you that your reservation on the stand space <strong>$position_name</strong> on the event <strong>$event_name</strong> has been cancelled by an Admin at $edit_time<br /><br /></p>\r\n<p><strong>Comment from the Admin:</strong></p>\r\n<p>$comment</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(56, 'reservation_cancelled', 'es', 'Reservation cancelled', '<p>Dear user,</p>\r\n<p>We regret to inform you that your reservation has been cancelled by an administrator.</p>\r\n<p>Best regards,<br />Chartbooker International</p>'),
(57, 'reservation_cancelled', 'sv', 'Reservation nekad - $event_name', '<p>$cancelled_name,</p>\r\n<p>Vi m&aring;ste tyv&auml;rr meddela att den reservation ni gjort p&aring; platsen <strong>$position_name</strong> p&aring; evenemanget <strong>$event_name</strong> har blivit nekad av arrang&ouml;ren $edit_time</p>\r\n<p><strong>Kommentar fr&aring;n arrang&ouml;ren:</strong></p>\r\n<p>$comment</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(58, 'booking_cancelled', 'de', 'Booking cancelled', '<p>Dear user,</p>\r\n<p>We regret to inform you that your booking has been cancelled by an administrator.</p>\r\n<p>Best regards,<br />Chartbooker International</p>'),
