(73, 'activate_welcome', 'sv', 'Välkommen till Chartbooker!', '<p>V&auml;lkommen till Chartbooker!</p>\r\n<p>Anv&auml;ndarnamn: $alias<br />Accessniv&aring;: $accesslevel</p>\r\n<p><a href="$url">$url</a></p>\r\n<p>F&ouml;r Er s&auml;kerhet skickar vi ej ut det l&ouml;senord ni registrerade er med.</p>\r\n<p>Om ni har problem med att logga in med dessa inloggningsuppgifter, bes&ouml;k d&aring; http://www.chartbooking.com/user/resetPassword och skriv in den epostadress ni registrerade er med f&ouml;r att f&aring; ett nytt l&ouml;senord.</p>\r\n<p>&nbsp;</p>\r\n<p>Med v&auml;nligaste h&auml;lsning,<br />Chartbooker International</p>'),
(74, 'activate_welcome', 'eng', 'Welcome to Chartbooker', '<p>Welcome to Chartbooker!</p>\r\n<p>Username: $alias<br />Access level: $accesslevel</p>\r\n<p><a href="$url">$url</a></p>\r\n<p>For your security, we do not send out your registered password.</p>\r\n<p>If you have trouble logging in with these login details, please visit http://www.chartbooking.com/user/resetPassword and insert your email address to recieve a new password.</p>\r\n<p>Best regards,<br />Chartbooker International</p>'),
(75, 'activate_welcome', 'sv', 'Välkommen till Chartbooker!', '<p>V&auml;lkommen till Chartbooker!</p>\r\n<p>Anv&auml;ndarnamn: $alias<br />Accessniv&aring;: $accesslevel</p>\r\n<p><a href="$url">$url</a></p>\r\n<p>F&ouml;r Er s&auml;kerhet skickar vi ej ut det l&ouml;senord ni registrerade er med.</p>\r\n<p>Om ni har problem med att logga in med dessa inloggningsuppgifter, bes&ouml;k d&aring; http://www.chartbooking.com/user/resetPassword och skriv in den epostadress ni registrerade er med f&ouml;r att f&aring; ett nytt l&ouml;senord.</p>\r\n<p>&nbsp;</p>\r\n<p>Med v&auml;nligaste h&auml;lsning,<br />Chartbooker International</p>'),
(76, 'activate_welcome', 'de', 'Welcome to Chartbooker', '<p>Welcome to Chartbooker!</p>\r\n<p>Username: $alias<br />Access level: $accesslevel</p>\r\n<p><a href="$url">$url</a></p>\r\n<p>For your security, we do not send out your registered password.</p>\r\n<p>If you have trouble logging in with these login details, please visit http://www.chartbooking.com/user/resetPassword and insert your email address to recieve a new password.</p>\r\n<p>Best regards,<br />Chartbooker International</p>\r\n<p>&nbsp;</p>'),
