(100, 'stand_place_remind1', 'sv', 'Din reservation utgår om $days_until_expiration dagar - $event_name', '<p>$namn,</p>\r\n<p>Vi vill p&aring;minna Er om att er reserverade plats $stand_space_name utg&aring;r $date_expires.</p>\r\n<p>Arrang&ouml;rens kommentar:</p>\r\n<p>$reminder_note</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta &auml;r ett automatiskt meddelande, genererat av CFS (Chartbooker Fair System)<br /></em></p>\r\n<p><em>Om ni har n&aring;gra fr&aring;gor om denna p&aring;minnelse, v&auml;nd er d&aring; till arrang&ouml;ren av evenemanget.<br /></em></p>'),
