(102, 'booking_edited_receipt', 'sv', 'Din bokning har blivit redigerad', '<p>Hej,</p>\r\n<p>Din bokning p&aring; eventet <strong>$event_name</strong> p&aring; platsen <strong>$position_name</strong> ($position_information) har blivit redigerad <strong>$edit_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Meddelande fr&aring;n Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p><strong>Ditt sortiment:</strong> $exhibitor_commodity</p>\r\n<p><strong>Kategorier:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(103, 'booking_edited_receipt', 'eng', 'Your booking has been edited', '<p>Hi,</p>\r\n<p>Your booking on the event&nbsp;<strong>$event_name</strong> and stand space <strong>$position_name</strong> ($position_information) has been changed at <strong>$edit_time</strong>.</p>\r\n<p><strong>Message from organizer:</strong> $arranger_message</p>\r\n<p><strong>Your commodity:</strong> $exhibitor_commodity</p>\r\n<p><strong>Categories:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(104, 'new_preliminary_booking', 'sv', 'Ny preliminärbokning', '<p>B&auml;ste Arrang&ouml;r,</p>\r\n<p>En ny prelimin&auml;rbokning blev gjord p&aring; plats $position_name ($position_information) vid tidpunkten $booking_time.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Namn:</strong> $exhibitor_name<br /><strong>Sortiment:</strong> $exhibitor_commodity<br /><strong>Valda kategorier:</strong> $exhibitor_category<br /><strong>Meddelande till Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(105, 'new_preliminary_booking', 'eng', 'New preliminary booking', '<p>Dear Organizer,</p>\r\n<p>A new preliminary booking was made on the stand space $position_name at $booking_time</p>\r\n<p><strong>Name:</strong> $exhibitor_name<br /><strong>Commodity:</strong> $exhibitor_commodity<br /><strong>Chosen categories:</strong> $exhibitor_category<br /><strong>Message to Organizer:</strong> $arranger_message</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>\r\n<p>&nbsp;</p>'),
(106, 'receipt_preliminary_booking', 'sv', 'Bekräftelse av preliminärbokning', '<p>Hej <strong>$exhibitor_name</strong>,</p>\r\n<p>&nbsp;</p>\r\n<p>Detta &auml;r en bekr&auml;ftelse f&ouml;r din prelimin&auml;rbokning i evenemanget <strong>$event_name</strong> p&aring; platsen <strong>($position_name)</strong>&nbsp;vid tidpunkten <strong>$booking_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p>Fr&aring;n och med nu &auml;r det upp till Arrang&ouml;ren av evenemanget att godk&auml;nna, neka eller rekommendera en ny plats till Er.</p>\r\n<p>L&auml;nk till evenemanget: <a href="$url">$url</a></p>\r\n<p><span style="text-decoration: underline;">&nbsp;_________________________________________________________________________</span></p>\r\n<p><strong>Information om platsen:</strong> $position_information</p>\r\n<p><strong>Ditt sortiment:</strong> $exhibitor_commodity</p>\r\n<p><strong>Valda kategorier:</strong> $exhibitor_category</p>\r\n<p><strong>Meddelande till Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p>&nbsp;</p>\r\n<p><em>&nbsp;</em></p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(107, 'receipt_preliminary_booking', 'eng', 'Receipt on your preliminary booking', '<p>Dear <strong>$exhibitor_name</strong>,</p>\r\n<p>&nbsp;</p>\r\n<p>This is a receipt of your preliminary booking that you made on the event <strong>$event_name</strong> at stand space (<strong>$position_name</strong>) at <strong>$booking_time</strong>.</p>\r\n<p>From now on it is up to the Organizer of the event to either approve, deny or recommend a new stand space for you.</p>\r\n<p>Link to the event: <a href="$url">$url</a></p>\r\n<p>_________________________________________________________________________</p>\r\n<p><strong>Information about the stand space:</strong> $position_information</p>\r\n<p><strong>Commodity:</strong> $exhibitor_commodity</p>\r\n<p><strong>Chosen categories:</strong> $exhibitor_category</p>\r\n<p><strong>Message to Organizer:</strong> $arranger_message</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(108, 'receipt_preliminary_booking', 'sv', 'Bekräftelse av preliminärbokning', '<p>Hej <strong>$exhibitor_name</strong>,</p>\r\n<p>&nbsp;</p>\r\n<p>Detta &auml;r en bekr&auml;ftelse f&ouml;r din prelimin&auml;rbokning i evenemanget <strong>$event_name</strong> p&aring; platsen <strong>($position_name)</strong>&nbsp;vid tidpunkten <strong>$booking_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p>Fr&aring;n och med nu &auml;r det upp till Arrang&ouml;ren av evenemanget att godk&auml;nna, neka eller rekommendera en ny plats till Er.</p>\r\n<p>L&auml;nk till evenemanget: <a href="$url">$url</a></p>\r\n<p><span style="text-decoration: underline;">&nbsp;_________________________________________________________________________</span></p>\r\n<p><strong>Information om platsen:</strong> $position_information</p>\r\n<p><strong>Ditt sortiment:</strong> $exhibitor_commodity</p>\r\n<p><strong>Valda kategorier:</strong> $exhibitor_category</p>\r\n<p><strong>Meddelande till Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p>&nbsp;</p>\r\n<p><em>&nbsp;</em></p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(109, 'booking_edited_receipt', 'sv', 'Din bokning har blivit redigerad', '<p>Hej,</p>\r\n<p>Din bokning p&aring; eventet <strong>$event_name</strong> p&aring; platsen <strong>$position_name</strong> ($position_information) har blivit redigerad <strong>$edit_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Meddelande fr&aring;n Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p><strong>Ditt sortiment:</strong> $exhibitor_commodity</p>\r\n<p><strong>Kategorier:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(110, 'booking_cancelled', 'eng', 'Booking cancelled', '<p>Dear $cancelled_name,</p>\r\n<p>We regret to inform you that your booking on the stand space <strong>$position_name</strong> on the event <strong>$event_name</strong> has been cancelled by an Admin at $edit_time<br /><br /></p>\r\n<p><strong>Comment from the Admin:</strong></p>\r\n<p>$comment</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(111, 'reservation_edited_receipt', 'sv', 'Din reservation har blivit redigerad - $event_name', '<p>Hej,</p>\r\n<p>Din reservation p&aring; eventet <strong>$event_name</strong> p&aring; platsen <strong>$position_name</strong> ($position_information) blev redigerad <strong>$edit_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Meddelande till Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p><strong>Reserverad t o m:</strong> $date_expires</p>\r\n<p><strong>Sortiment:</strong> $exhibitor_commodity</p>\r\n<p><strong>Valda kategorier:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(112, 'reservation_edited_receipt', 'en', 'Your reservation has been edited', '<p>Hi,</p>\r\n<p>Your reservation on stand space $position_name ($position_information) has been changed at $edit_time.</p>\r\n<p>Message to Organizer: $arranger_message</p>\r\n<p>Reservation expiration time: $date_expires</p>\r\n<p>Your commodity: $exhibitor_commodity</p>\r\n<p>Categories chosen: $exhibitor_category</p>'),
(113, 'reservation_edited_receipt', 'eng', 'Your reservation has been edited - $event_name', '<p>Hi,</p>\r\n<p>Your reservation on the event&nbsp;<strong>$event_name</strong> on stand space <strong>$position_name</strong> ($position_information) has been changed at <strong>$edit_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Message to Organizer:</strong> $arranger_message</p>\r\n<p><strong>Reservation expiration time:</strong> $date_expires</p>\r\n<p><strong>Your commodity:</strong> $exhibitor_commodity</p>\r\n<p><strong>Categories chosen:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(114, 'reservation_edited_receipt', 'sv', 'Din reservation har blivit redigerad - $event_name', '<p>Hej,</p>\r\n<p>Din reservation p&aring; eventet <strong>$event_name</strong> p&aring; platsen <strong>$position_name</strong> ($position_information) blev redigerad <strong>$edit_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Meddelande till Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p><strong>Reserverad t o m:</strong> $date_expires</p>\r\n<p><strong>Sortiment:</strong> $exhibitor_commodity</p>\r\n<p><strong>Valda kategorier:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(115, 'reservation_edited_receipt', 'eng', 'Your reservation has been edited - $event_name', '<p>Hi,</p>\r\n<p>Your reservation on the event&nbsp;<strong>$event_name</strong> on stand space <strong>$position_name</strong> ($position_information) has been changed at <strong>$edit_time</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Message to Organizer:</strong> $arranger_message</p>\r\n<p><strong>Reservation expiration time:</strong> $date_expires</p>\r\n<p><strong>Your commodity:</strong> $exhibitor_commodity</p>\r\n<p><strong>Categories chosen:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(116, 'new_preliminary_booking', 'sv', 'Ny preliminärbokning', '<p>B&auml;ste Arrang&ouml;r,</p>\r\n<p>En ny prelimin&auml;rbokning blev gjord p&aring; plats $position_name ($position_information) vid tidpunkten $booking_time.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Namn:</strong> $exhibitor_name<br /><strong>Sortiment:</strong> $exhibitor_commodity<br /><strong>Valda kategorier:</strong> $exhibitor_category<br /><strong>Meddelande till Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(117, 'booking_cancelled_confirm', 'sv', 'Bokning nekad', '<p>Bokningen f&ouml;r platsen $position_name blev nekad av $cancelled_name vid tidpunkten $edit_time.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Ansvariges kommentar:<br /></strong></p>\r\n<p>$comment</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
(118, 'booking_cancelled_confirm', 'eng', 'Booking cancelled', '<p>The booking at stand space $position_name was cancelled by $cancelled_name at $edit_time.</p>\r\n<p><strong>Comment about the deletion:</strong></p>\r\n<p>$comment</p>\r\n<p>&nbsp;</p>\r\n<p><em>This mail is automatically generated by the Chartbooker Fair System.</em></p>\r\n<p><em>If this email is not meant for you, please disregard this email.</em></p>'),
(119, 'booking_edited_confirm', 'sv', 'En bokning har blivit redigerad', '<p>Hej,</p>\r\n<p>En bokning p&aring; eventet <strong>$event_name</strong> p&aring; platsen <strong>$position_name</strong> ($position_information) har blivit redigerad <strong>$edit_name</strong>.</p>\r\n<p><strong>Meddelande fr&aring;n Arrang&ouml;ren:</strong> $arranger_message</p>\r\n<p><strong>Sortiment:</strong> $exhibitor_commodity</p>\r\n<p><strong>Valda kategorier:</strong> $exhibitor_category</p>\r\n<p>&nbsp;</p>\r\n<p><em>Detta mail &auml;r automatiskt genererat av Chartbooker Fair System.</em></p>\r\n<p><em>Om detta mail kommit fel ber vi om urs&auml;kt f&ouml;r detta och ber er att bortse fr&aring;n detta mail.</em></p>'),
