ng><br />Tel: </strong>0760-058882<br /> <strong>E-post:</strong> <a href="mailto:alexis.wallen@chartbooker.com">alexis.wallen@chartbooker.com</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__4701980.png" alt="" width="100" height="100" /></p>\r\n</td>\r\n<td><strong><span style="color: darkgreen;">Kontor:</span><br />Tel: </strong>019-294690<strong><br />Fax: </strong>019-294662<strong><br />Allm&auml;nna fr&aring;gor via E-post:</strong> <a href="mailto:info@chartbooker.com">info@chartbooker.com</a><br /><strong>Hemsida: </strong><a href="http://www.chartbooker.com/sv/">Chartbooker.com</a></td>\r\n</tr>\r\n</tbody>\r\n</table>'),
('help', 'en', '<p><strong>A STAND''S CURRENT STATUS IS DETERMINED BY ITS COLOUR</strong></p>\r\n<p>Hover the mouse over the coloured dots to see more information about the stand.</p>\r\n<p><strong><img src="../../../images/icons/marker_open.png" alt="" /> = Open stand<br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_reserved.png" alt="" /> = Reserved stand</strong></p>\r\n<p><strong> <img src="../../../images/icons/marker_booked.png" alt="" /> = Booked stand</strong></p>\r\n<p><strong><img src="../../../images/icons/marker_applied.png" alt="Prelimin&auml;rbokad plats" /> = Preliminary booked stand (only visible to the exhibitor alone)<br /></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>NEW CUSTOMER</strong></p>\r\n<p>Fill in your personal information. All fields marked * are mandatory.</p>\r\n<p><strong>The username you create is connected to an e-mail adress of your choosing.</strong></p>\r\n<p><strong>You will get a password sent to your e-mail adress after you''ve completed your registration.</strong></p>'),
('help', 'sv', '<p><strong>Var &auml;ndrar jag spr&aring;k?</strong></p>\r\n<p>Du kan v&auml;lja spr&aring;k mellan svenska, engelska, spanska och tyska genom att trycka p&aring; flaggan h&ouml;gst upp i h&ouml;gra h&ouml;rnet av hemsidan.</p>\r\n<p><strong><br /><br />PLATSERNAS OLIKA F&Auml;RGER VISAR EN PLATS STATUS</strong></p>\r\n<p>F&ouml;r musen &ouml;ver de f&auml;rgade prickarna f&ouml;r att se information om platsen.<strong><br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_open.png" alt="" /> = Ledig plats<br /><br /></strong><strong><img src="../../../images/icons/marker_reserved.png" alt="" /> = Reserverad plats<br /></strong></p>\r\n<p><strong> <img src="../../../images/icons/marker_booked.png" alt="" /> = F&auml;rdigbokad plats<br /></strong><strong><br /><img src="../../../images/icons/marker_applied.png" alt="Prelimin&auml;rbokad plats" /> = Prelimin&auml;rbokad plats (endast synlig f&ouml;r Utst&auml;llaren sj&auml;lv)</strong></p>\r\n<p><br /><strong>OBS!</strong> Du beh&ouml;ver vara registrerad f&ouml;r att kunna boka en plats. Du kan sj&auml;lv registrera dig som Ny kund genom att klicka p&aring; knappen "Ny kund?" i huvudmenyn.<br />Har du fr&aring;gor om Chartbooker Fair system s&aring; finns aktuella kontaktuppgifter p&aring; www.chartbooker.com<br /><strong><br /><br /></strong></p>\r\n<ol>\r\n<li><strong>NY KUND<br /><br /></strong>1. Klicka p&aring; knappen "NY KUND?" p&aring; huvudmenyn. Fyll sedan i dina uppgifter; alla f&auml;lt markerade med * &auml;r obligatoriska.<br />2. I f&auml;ltet "Anv&auml;ndarnamn" skriver du i det namn du vill ha p&aring; ditt konto. Det namnet anv&auml;nder du sedan n&auml;r du ska logga in p&aring; ditt konto.<br />3. Du f&aring;r nu ett l&ouml;senord skickad till din e-postadress.<br />4. Tryck p&aring; aktiveringsl&auml;nken som finns i mailet.<br />5. F&auml;rdigt! Nu kan du logga in och boka platser. <br /><strong><br />VIKTIGT - SE TILL ATT ALLTID SPARA DITT ANV&Auml;NDARNAMN OCH L&Ouml;SENORD!<br /></strong>Anv&auml;ndaruppgifterna skall du anv&auml;nda f&ouml;r inloggning n&auml;r bokning sker till andra m&auml;ssor, marknader och event som anv&auml;nder sig av Chartbooker Fair System.<br /><br /><br /></li>\r\n<li><strong>Kartvyn<br /><br /></strong>N&auml;r du har registrerat dig till ett event kan du g&aring; in p&aring; kartan &ouml;ver omr&aring;det genom att klicka p&aring; "VISA KARTA" i systemets huvudmeny.<br /><br /><br /></li>\r\n<li><strong>Platsbokningen fungerar s&aring; h&auml;r:</strong><br /><br />Alla kan boka valfri ledig plats (gr&ouml;n punkt) enligt &ouml;nskem&aring;l.<br />Klicka p&aring; den platsen du &ouml;nskar att boka och v&auml;lj "prelimin&auml;rboka plats". Skriv in all n&ouml;dv&auml;ndig information och tryck "boka".<br />N&auml;r &ouml;nskad plats &auml;r bokad s&auml;nds uppgifterna med automatik till arrang&ouml;ren.<br /><br />En plats kan vara bokad flera g&aring;nger av olika utst&auml;llare. Ett k&ouml;system h&aring;ller reda p&aring; vilka som bokat platsen f&ouml;rst.<br />Det &auml;r arrang&ouml;ren som slutligen best&auml;mmer vilken utst&auml;llare som l&auml;mpar sig b&auml;st f&ouml;r platsen.<br /><br /><br /></li>\r\n<li><strong>Utst&auml;llarlistan</strong><br /><br />P&aring; h&ouml;ger sida av kartan &ouml;ver eventet finns det en utst&auml;llarlista. Listan visar vilka utst&auml;llare som har anm&auml;lt sig och blivit tilldelade en plats p&aring; eventet. <br />Anv&auml;nd s&ouml;kf&auml;ltet om det &auml;r en s&auml;rskild utst&auml;llare ni vill hitta.<br />Ifall ni trycker p&aring; ett namn i listan kommer ni automatiskt att f&ouml;rflyttas till den plats som utst&auml;llaren blivit tilldelad. <br />Anv&auml;nd listan f&ouml;r att l&auml;ttare planera var du vill/b&ouml;r st&aring;.<br /><br /><br /></li>\r\n<li><strong>Hur du byter mellan olika event (hur du anv&auml;nder dig av knappen EVENTS)<br /></strong><br />Alla event som du har registrerat dig till samlas under knappen "EVENTS" i huvudmenyn.<br />S&aring; snart du har anm&auml;lt ditt intresse/prelimin&auml;rbokat en plats p&aring; ett event finns eventet som en valbar undermeny till denna knapp.<br />H&auml;r kan du v&auml;lja vilket event du vill jobba med f&ouml;r tillf&auml;llet.<br />Du kan bara jobba med ett event i taget, men det g&aring;r att byta event n&auml;r du vill och hur ofta du vill.<br /><br /></li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<h2>FAQ f&ouml;r utst&auml;llare i Chartbooker Fair System</h2>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Hur &auml;ndrar jag p&aring; mina kontouppgifter?</strong><br /><br />Klicka p&aring; "MIN PROFIL" i huvudmenyn. Du f&aring;r nu upp alla dina kontouppgifter. Tryck p&aring; den textruta du &ouml;nskar att &auml;ndra f&ouml;r att skriva i nya uppgifter. Du kan &auml;ndra p&aring; allting utom ditt anv&auml;ndarnamn.<br /><br /><br /></li>\r\n<li><strong>Gl&ouml;mt anv&auml;ndarnamn eller l&ouml;senord?<br /></strong><br />Om du har gl&ouml;mt ditt anv&auml;ndarnamn eller l&ouml;senord till ditt konto skall du f&ouml;rst trycka p&aring; "logga in".<br />N&auml;r du f&aring;r upp inloggningsrutan v&auml;ljer du "Gl&ouml;mt anv&auml;ndarnamn eller l&ouml;senord?&rdquo;<br />Efter du har tryckt p&aring; l&auml;nken kommer du f&aring; upp en sida med ett enstaka textf&auml;lt. H&auml;r skriver du in ditt kontos anv&auml;ndarnamn eller e-mailadress.<br />Du kommer nu att f&aring; ett mail inneh&aring;llandes ditt anv&auml;ndarnamn och ett nytt l&ouml;senord. Anv&auml;nd detta f&ouml;r att logga in p&aring; ditt konto.<br />Du kan n&auml;r som helst &auml;ndra p&aring; ditt l&ouml;senord under "MIN PROFIL" --&gt; "BYT L&Ouml;SENORD" i huvudmenyn.<br /><br /><br /></li>\r\n<li><strong>Varf&ouml;r visas inte kartan som den ska?<br /></strong><br />Om du upplever att kartan inte visas som den ska kan det vara f&ouml;r att webbl&auml;saren sp&ouml;kar.<br />Prova att uppdatera sidan genom att trycka p&aring; tangenten "F5" p&aring; tangentbordet.<br />Ni kan &auml;ven testa att rensa er cache och tempor&auml;ra filer genom att h&aring;lla in dessa tre knappar samtidigt efter f&ouml;ljande sekvens: "ctrl + shift + delete".<br /><br /><br /><br /></li>\r\n<li><strong>Jag har f&aring;tt min prelimin&auml;rbokning godk&auml;nd, men jag hade skrivit in fel information i n&aring;got av textf&auml;lten. Kan jag &auml;ndra p&aring; det i efterhand?<br /> </strong><br />Om du beh&ouml;ver &auml;ndra p&aring; n&aring;gon information i din bokning g&aring;r detta <strong>endast</strong> att g&ouml;ra om din bokning befinner sig i "prelimin&auml;rbokad" status. S&aring; snart som din bokning &auml;r "reserverad" (bl&aring;) eller "bokad" (r&ouml;d) m&aring;ste du kontakta arrang&ouml;ren om du vill g&ouml;ra en &auml;ndring i din bokning. F&ouml;r att se arrang&ouml;rens kontaktuppgifter; klicka p&aring; eventet du vill jobba med under knappen "EVENT" i huvudmenyn. N&auml;r det &auml;r gjort, klicka p&aring; knappen "KONTAKTA OSS" i huvudmenyn.</li>\r\n</ol>'),
('help', 'de', '<p><strong>THE STAND SPACES DIFFERENT COLOURS SHOWS A STAND SPACE TEMPORARY STATUS</strong></p>\r\n<p>Drag your mouse over the coloured spots to reveal information about the stand space.<strong><br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_open.png" alt="" /> = Free stand space<br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_reserved.png" alt="" /> = Reserved stand space<br /></strong></p>\r\n<p><strong> <img src="../../../images/icons/marker_booked.png" alt="" /> = Booked stand space<br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_applied.png" alt="Prelimin&auml;rbokad plats" /> = Preliminary booked stand space (only visible for the Exhibitor him/herself)<br /></strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>NEW EXHIBITOR</strong></p>\r\n<p>Insert your information. All fields marked with * are needed to complete the form.</p>\r\n<p><strong>The username is what you typed into the field named "Alias".</strong></p>\r\n<p><strong>You will have a password sent to your e-mail adress.<br /><br /><br /></strong></p>\r\n<h2>FAQ</h2>\r\n<p><strong><br />What does the button &rdquo;EVENT&rdquo; in the main menu do?<br /></strong>Answer: All the events you&rsquo;ve registered to are gathered here. As soon as you have registered to an event it is placed as a selectable alternative in the sub-menu. Here you can choose which event you want to work with at the moment. You can only work with one event at the time, but you can switch freely whenever and as much as you want.<strong><br /><br /><br />Why doesn''t the map</strong> <strong>show properly</strong><strong>?<br /></strong>Answer: Try updating the page (F5) or clear your cache (press ctrl + shift + delete and select to delete your temporary internet files).<br /><br /></p>\r\n<p>&nbsp;</p>'),
('help', 'es', '<p><strong>EL ESTADO ACTUAL DE LOS STANDS SE DETERMINA POR SU COLOR</strong></p>\r\n<p>Pase el rat&oacute;n sobre los puntos rojos para mayor informaci&oacute;n sobre el soporte.</p>\r\n<p><strong><img src="../../../images/icons/marker_open.png" alt="" /> = Stand libre<br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_reserved.png" alt="" /> = Stand reservado<br /></strong></p>\r\n<p><strong> <img src="../../../images/icons/marker_booked.png" alt="" /> = Stand ocupado<br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_applied.png" alt="Prelimin&auml;rbokad plats" /> = Reserva preliminar del stand (visible s&oacute;lo para el expositor)<br /></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>NUEVO USUARIO?<br /></strong></p>\r\n<p>Sirvase llenar correctamente la informaci&oacute;n en el formulario de registo. Todos los campos marcados con * son obligatorios.</p>\r\n<p><strong>Es importante como usuario que la direcci&oacute;n a su correo electr&oacute;nico sea de uso continuo, ya que su contrase&ntilde;a ser&aacute; enviada via e-mail en caso que ud la olvide.</strong></p>\r\n<p><strong>&nbsp;</strong></p>'),
