('contact', 'es', '<p>&nbsp;</p>\r\n<table style="width: 600px; height: 523px;">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__3543255_orig.jpg" alt="" width="158" height="190" /><br /><span style="color: darkgreen;"><strong>Leif Wall&eacute;n</strong></span><br style="color: darkgreen;" /><strong>Idioma:</strong> ingl&eacute;s, sueco, espa&ntilde;ol, alem&aacute;n<br /><strong>M&oacute;bil:</strong> 46+(0)705-294662<br /><strong>E-mail:</strong> <a href="mailto:leif.wallen@chartbooker.com">leif.wallen@chartbooker.com</a></td>\r\n<td>&nbsp;<img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__3277531_orig.jpg" alt="" width="158" height="190" /><br /><strong><span style="color: darkgreen;">Eduardo Wall&eacute;n</span></strong><br /><strong>Idioma:</strong> ingl&eacute;s, sueco<br /><strong>M&oacute;bil</strong>: 46+(0)707-386668<br /><strong>E-mail:</strong> <a href="mailto:eduardo.wallen@chartbooker.com">eduardo.wallen@chartbooker.com</a></td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;<img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__2350287_orig.jpg" alt="" width="158" height="190" /><br /><strong><span style="color: darkgreen;">Susana Herbozo</span></strong><br /><strong>Idioma:</strong> espa&ntilde;ol, sueco.<br /><strong>M&oacute;bil:</strong> 46+(0)702-584709<br /><strong>E-mail:</strong> <a href="mailto:info@chartbooker.com">info@chartbooker.com</a></td>\r\n<td>&nbsp;<img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__7313793_orig.jpg" alt="" width="158" height="190" /><br /><span style="color: darkgreen;"><strong>Alexis Wall&eacute;n</strong></span><br /><strong>Idioma:</strong> sueco, ingl&eacute;s<br /><strong>M&oacute;bil: </strong>46+(0)760-508882<br /><strong>E-mail: </strong><a href="mailto:alexis.wallen@chartbooker.com">alexis.wallen@chartbooker.com</a><span><strong><br /></strong></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td><img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__4701980.png" alt="" width="100" height="100" /></td>\r\n<td>\r\n<h2>Oficina</h2>\r\n<p><strong>Tel&eacute;fono:</strong> 46+(0)19-294690<br /><strong>Fax:</strong> +46(0)19-294662<br /><strong>E-mail:</strong> <a href="mailto:info@chartbooker.com">info@chartbooker.com</a><br /><strong>Direcci&oacute;n postal:</strong> <br />Chartbooker International AB<br />Vintrosa 740<br />SE-719 31 VINTROSA, SU&Eacute;CIA</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
('help_organizer', 'en', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris mattis placerat est in pharetra. Aenean fringilla fermentum elit non tempus. Proin est magna, pellentesque vel accumsan eget, lobortis eget urna. Proin sollicitudin, nisl sed semper laoreet, nulla purus porta sem, vel luctus est magna vel turpis. Sed eu mollis lorem. Nullam viverra suscipit dolor, feugiat sagittis tortor pulvinar id. Nam metus enim, eleifend tincidunt tempus id, ornare at risus. Quisque ultricies ultrices urna sit amet accumsan.</p>\r\n<p>Aenean ut pharetra nisi. Aliquam quis enim dictum risus convallis vulputate. Ut id dolor tortor, a rutrum felis. Aliquam sit amet libero mi, nec consectetur enim. Nunc orci turpis, tempus in pharetra et, feugiat ultricies elit. Fusce eros magna, bibendum id sodales quis, cursus in mi. Ut fermentum rutrum libero non lobortis. Cras eget consectetur augue. Donec pharetra congue mattis. Proin eu accumsan orci. Phasellus sed commodo magna.</p>\r\n<p>Vivamus massa odio, ullamcorper vel porttitor et, tincidunt id erat. Vestibulum sit amet ante est. Sed nec risus et elit eleifend condimentum. Fusce mauris tellus, rutrum non venenatis a, mollis in mi. Maecenas ultricies condimentum velit eget mattis. Vivamus accumsan odio at ante euismod in egestas urna venenatis. Duis et sapien tellus, ac tempus metus. Vestibulum convallis aliquet sodales. In hac habitasse platea dictumst. Nam sed pulvinar tellus. Phasellus non quam neque, non pellentesque leo.</p>\r\n<p>Nunc vitae arcu id lectus volutpat semper. In hac habitasse platea dictumst. Phasellus vel elit sit amet nulla faucibus cursus ut sit amet lectus. Aenean ultrices orci sit amet tellus convallis ut sagittis ante lobortis. Curabitur ipsum mi, facilisis molestie tincidunt quis, lacinia et sem. Proin sed sodales velit. Donec facilisis auctor elit, sit amet tempor est dictum ut.</p>\r\n<p>Sed et ullamcorper enim. Mauris tortor nisi, iaculis sed mollis ut, vulputate ac ante. Curabitur eget purus odio. Nulla arcu nunc, fermentum vitae sodales quis, tincidunt sed nibh. Ut condimentum eleifend scelerisque. Donec placerat congue est, ut viverra orci cursus eget. Proin laoreet urna eget enim mollis congue. Aliquam eleifend tincidunt luctus. In dictum, ligula ac tempor convallis, tortor elit semper metus, auctor rutrum nisi diam ac orci. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. In fringilla pellentesque hendrerit. Proin a dui arcu.</p>'),
('help_organizer', 'sv', '<p>&nbsp;<br /><strong>PLATSERNAS OLIKA F&Auml;RGER VISAR EN PLATS STATUS </strong><br /><br />F&ouml;r musen &ouml;ver de f&auml;rgade prickarna f&ouml;r att se information om platsen.</p>\r\n<p><strong><img src="../../../images/icons/marker_open.png" alt="" /> </strong>= Ledig plats</p>\r\n<p><strong><img src="../../../images/icons/marker_reserved.png" alt="" /> </strong>= Reserverad plats</p>\r\n<p><strong><img src="../../../images/icons/marker_booked.png" alt="" /> </strong>= F&auml;rdigbokad plats</p>\r\n<p><strong><img src="../../../images/icons/marker_applied.png" alt="Prelimin&auml;rbokad plats" /> </strong>= Prelimin&auml;rbokad plats</p>\r\n<p><br /><br /></p>\r\n<h2>FAQ f&ouml;r&nbsp;arrang&ouml;rer och administrat&ouml;rer i Chartbooker Fair System<br /><br /></h2>\r\n<ol>\r\n<li><strong>Var byter jag l&ouml;senord?<br /></strong>H&aring;ll din muspekare &ouml;ver "MIN PROFIL" i huvudmenyn f&ouml;r att visa ytterligare alternativ. Klicka sedan p&aring; "BYT L&Ouml;SENORD". Ditt l&ouml;senord beh&ouml;ver inneh&aring;lla minst 8 tecken, varav ett tecken en versal och tv&aring; tecken siffror.<strong><br /><br /><br /></strong></li>\r\n<li><strong>Hur &auml;ndrar jag p&aring; mina personuppgifter?</strong><br />Klicka p&aring; "MIN PROFIL" i huvudmenyn. Du f&aring;r nu upp alla dina personliga uppgifter. Tryck p&aring; den textruta du &ouml;nskar att &auml;ndra f&ouml;r att skriva i nya uppgifter. Du kan &auml;ndra p&aring; allting utom ditt anv&auml;ndarnamn. <strong><br /><br /><br /></strong></li>\r\n<li><strong>Hur skapar jag ett event?</strong><br />G&aring; till huvudmenyn och h&aring;ll muspekaren &ouml;ver fliken &rdquo;MIN PROFIL&rdquo; f&ouml;r att f&aring; fram en undermeny. Klicka p&aring; &rdquo;MINA EVENT&rdquo;.<br />Du kommer nu att f&aring; upp en lista &ouml;ver alla dina tidigare skapade event. Om du inte har skapat ett event tidigare kommer det listan att vara tom. F&ouml;r att skapa ett event, tryck p&aring; knappen &rdquo;Skapa nytt event&rdquo;, fyll i de uppgifter som kr&auml;vs och tryck sedan p&aring; &rdquo;Spara&rdquo;.<br /><br /><br /></li>\r\n<li><strong>Jag har skapat ett event, var l&auml;gger jag in min karta?</strong><br />Om du g&aring;r in p&aring; &rdquo;Min profil&rdquo; -&gt; &rdquo;Mina event&rdquo; f&aring;r du upp alla event du har skapat.<br />V&auml;lj knappen &rdquo;inst&auml;llningar&rdquo; p&aring; det event du vill l&auml;gga in en karta p&aring;.<br />Du kommer nu att komma in p&aring; inst&auml;llningarna f&ouml;r ditt event. &Ouml;verst p&aring; sidan finns en knapp som lyder &rdquo;Hantera kartor&rdquo;. Tryck p&aring; denna f&ouml;r att l&auml;gga till, redigera eller ta bort kartor f&ouml;r ditt event.<br /><br /><br /></li>\r\n<li><strong>Hur l&auml;gger jag till/modifierar jag kategorier till mitt event?</strong><br />Om du g&aring;r in p&aring; &rdquo;Min profil&rdquo; -&gt; &rdquo;Mina event&rdquo; f&aring;r du upp alla event du har skapat.<br />V&auml;lj knappen &rdquo;kategorier&rdquo; p&aring; det event du vill l&auml;gga till en kategori p&aring;.<br />Du kommer nu att komma in p&aring; inst&auml;llningarna f&ouml;r kategorier p&aring; ditt event. Antalet kategorier som kan l&auml;ggas till &auml;r obegr&auml;nsat.<br /><br /><br /></li>\r\n<li><strong>Hur raderar jag ett event?</strong><br />F&ouml;r att undvika of&ouml;rutsedda komplikationer beh&ouml;ver ni kontakta oss genom mail eller telefon f&ouml;r att radera ett event.<br /><br /><br /></li>\r\n<li><strong>Hur l&auml;gger jag in en monterplats p&aring; mitt event?</strong><br />F&ouml;rst beh&ouml;ver en karta ha lagts till p&aring; eventet (se punkt 2). N&auml;r detta &auml;r gjort kan du g&aring; in p&aring; kartvyn &ouml;ver ditt event.H&auml;r klickar du p&aring; knappen &rdquo;Ny utst&auml;llningsyta&rdquo; p&aring; h&ouml;ger sida av din webbl&auml;sare. N&auml;r du har klickat p&aring; knappen kommer en gr&ouml;n punkt att f&ouml;lja efter din muspekare. H&aring;ll muspekaren &ouml;ver det omr&aring;de p&aring; kartan d&auml;r du vill l&auml;gga in en monterplats och v&auml;nsterklicka en g&aring;ng. Den gr&ouml;na punkten kommer nu att fastna d&auml;r du tryckte. Du f&aring;r sedan upp en ruta d&auml;r du kan fylla i namn, area och eventuell extra information om platsen. Om du &ouml;nskar att avbryta processen; tryck ESC.<br /><br /><br /></li>\r\n<li><strong>Hur redigerar jag en plats?<br /></strong>Om en monterplats beh&ouml;ver redigeras r&auml;cker det med att v&auml;nsterklicka en g&aring;ng p&aring; den plats man vill redigera. Du kommer att f&aring; upp en lista med olika alternativ; v&auml;lj &rdquo;redigera monterplats&rdquo; f&ouml;r att &auml;ndra p&aring; informationen om platsen.<br /><br /><br /></li>\r\n<li><strong>Hur kan jag l&auml;gga till s&auml;rskild information om en plats, s&aring;som priser eller &ouml;vrig info?</strong><br />Denna typ av information kan l&auml;ggas in vid skapandet av en plats i rutan &rdquo;Information&rdquo;. Om du vill &auml;ndra den inskrivna informationen p&aring; en monterplats i efterhand kan du g&ouml;ra det under &rdquo;redigera monterplats&rdquo; (se punkt 8).<br /><br /><br /></li>\r\n<li><strong>Var ser jag hur m&aring;nga platser det finns och hur m&aring;nga lediga som &auml;r kvar?<br /></strong>P&aring; h&ouml;ger sida om kartvyn p&aring; ditt event finns en utst&auml;llarlista. Under rubriken "Utst&auml;llarlista" kan du se antalet platser samt hur m&aring;nga tillg&auml;ngliga som &aring;terst&aring;r.<br />Dessa siffror g&aring;r &auml;ven att se om du g&aring;r in p&aring; listan &ouml;ver dina skapade event. F&ouml;r att se listan &ouml;ver dina event; h&aring;ll muspekaren &ouml;ver "MIN PROFIL" i huvudmenyn och v&auml;lj sedan "MINA EVENT" i undermenyn.<br />\r\n<p>&nbsp;</p>\r\n</li>\r\n<li><strong>Jag vill skapa en administrat&ouml;r till mitt event. Hur g&ouml;r jag?</strong><br />1. I huvudmenyn finns en flik kallad "ADMINISTRAT&Ouml;RER" (eng. Administrators). Klicka p&aring; denna.<br />2. Du ser nu listan &ouml;ver dina administrat&ouml;rer. Om du inte har skapat n&aring;gon sedan innan &auml;r den tom s&aring;n&auml;r som p&aring; en knapp under namnet "Skapa ny administrat&ouml;r". Klicka p&aring; denna.<br />3. Fyll i registreringsformul&auml;ret till din nya administrat&ouml;r och v&auml;lj sedan vilket event denne ska f&aring; administrera genom att kryssa i de olika eventen p&aring; den h&ouml;gra sidan av ditt webbl&auml;sarf&ouml;nster.<br />OBS! N&auml;r du v&auml;ljer vilka event som administrat&ouml;ren ska f&aring; tillg&aring;ng till m&aring;ste du &auml;ven kryssa i vilka kartor som denne ska ansvara f&ouml;r.<br /><br /><br /></li>\r\n<li><strong>Kan flera administrat&ouml;rer jobba p&aring; en karta samtidigt?<br /></strong>Ja, antalet administrat&ouml;rer som kan jobba p&aring; en och samma karta &auml;r obegr&auml;nsad - beslutet &auml;r helt upp till dig som arrang&ouml;r.<br /><br /><br /></li>\r\n<li><strong>Var kan jag f&aring; en &ouml;versikt av alla mina administrat&ouml;rer?<br /></strong>I din huvudmeny finns fliken "ADMINISTRAT&Ouml;RER". H&auml;r kan du redigera/se alla dina aktuella administrat&ouml;rer och hur m&aring;nga platser de har skapat, platser de har redigerat, hur m&aring;nga event de har tillg&aring;ng till, n&auml;r de var senast inloggade samt om kontot &auml;r l&aring;st eller aktivt.<br /><br /><br /></li>\r\n<li><strong>Jag vill se vilka administrat&ouml;rer som ansvarar f&ouml;r ett s&auml;rskilt event?</strong><br />Klicka p&aring; "MINA EVENT" under "MIN PROFIL" i huvudmenyn. Du f&aring;r nu upp en lista p&aring; alla event du har skapat. Leta reda p&aring; det eventet du vill veta mer om. N&auml;r du hittat eventet kan du se att det finns fyra olika knappar (fr&aring;n v&auml;nster): "Kategorier", "Administrat&ouml;rer", "Utst&auml;llare" och "Inst&auml;llningar". V&auml;lj "Administrat&ouml;rer" f&ouml;r att f&aring; upp en lista &ouml;ver alla administrat&ouml;rer som har tillg&aring;ng till det valda eventet.<br /><br /><br /></li>\r\n<li><strong>Kan jag jobba p&aring; flera datorer/surfplattor/mobiler samtidigt?<br /></strong>Alla typer av konton p&aring; Chartbooker Fair System kan anv&auml;ndas p&aring; flera apparater samtidigt.<br /><br /><br /></li>\r\n<li><strong>Hur hittar jag en specifik utst&auml;llare p&aring; kartvyn ett event?<br /></strong>P&aring; h&ouml;ger sida om din karta finns en utst&auml;llarlista. Anv&auml;nd s&ouml;kf&auml;ltet i den &ouml;vre halvan av listan och skriv in namnet p&aring; utst&auml;llaren du s&ouml;ker efter.<br /><br /><br /></li>\r\n<li><strong>Vad anv&auml;nds "UTST&Auml;LLARE" (under "MIN PROFIL" i huvudmenyn) till? &nbsp;</strong> <br />Denna funktion anv&auml;nds f&ouml;r tv&aring; &auml;ndam&aring;l:<br /><br />1: att f&aring; en snabb &ouml;versikt p&aring; alla utst&auml;llare som har en f&auml;rdig bokning eller reservation p&aring; det event du arbetar med f&ouml;r tillf&auml;llet.<br />2: f&ouml;r att se de utst&auml;llare som har varit inloggade p&aring; sitt konto och kollat p&aring; eventet men inte har bokat n&aring;gon plats &auml;nnu. Dessa g&aring;r under listan "Intresserade utst&auml;llare".<br /><br />"Bokade utst&auml;llare" visar de utst&auml;llare som p&aring; n&aring;got s&auml;tt &auml;r inbokade p&aring; en plats.<br />"Intresserade utst&auml;llare" visar de som inte har bokat n&aring;gon plats &auml;nnu men som har varit inne och kollat p&aring; eventets karta.<br />"F.d. inbokade utst&auml;llare" visar de som har varit inbokade p&aring; eventet men som sedan har blivit avbokade av administrat&ouml;rerna.<br /><br />Denna lista kan f&ouml;rslagsvis anv&auml;ndas f&ouml;r att snabbt se om det finns fler intresserade utst&auml;llare att locka till erat event men som inte har h&ouml;rt av sig till er personligen.<br /><br /></li>\r\n<li><strong>Jag vill enbart se en typ av utst&auml;llare (exempelvis enbart PC-tillbeh&ouml;r) p&aring; kartan. Hur g&ouml;r jag?<br /></strong>P&aring; h&ouml;ger sida om din karta finns en utst&auml;llarlista. I &ouml;vre halvan &ndash; &ouml;ver s&ouml;kf&auml;ltet &ndash; finns det en listfunktion som g&ouml;r att du kan sortera m&auml;ssan p&aring; utst&auml;llare i en s&auml;rskild kategori.<br /><br /><br /></li>\r\n<li><strong>Jag vet att det finns flera m&auml;sshallar, men jag ser bara kartan &ouml;ver en av dem. Var hittar jag de andra?<br /></strong>Bredvid det &ouml;vre h&ouml;gra h&ouml;rnet av kartan (&ouml;ver utst&auml;llarlistan) finns det en ruta som heter &rdquo;Kartor&rdquo;. Om en m&auml;ssa har flera kartor kan ni bl&auml;ddra mellan dem d&auml;r.<br /><br /><br /></li>\r\n<li><strong>Vad h&auml;nder n&auml;r en utst&auml;llare bokar en plats?<br /></strong>N&auml;r en utst&auml;llare v&auml;ljer att prelimin&auml;rboka en plats hamnar deras f&ouml;rfr&aring;gan under &rdquo;BOKNINGAR&rdquo; under huvudmenyn &rdquo;MIN PROFIL&rdquo;. Platsen de har bokat forts&auml;tter att vara markerad i f&auml;rgen gr&ouml;n (ledig) tills dess att arrang&ouml;ren eller en administrat&ouml;r har godk&auml;nt utst&auml;llarens bokningsf&ouml;rfr&aring;gan.<br /><br /><br /></li>\r\n<li><strong>Jag vill veta om en s&auml;rskilt plats &auml;r prelimin&auml;rbokad men har sv&aring;rt att hitta den i listan. Hur g&ouml;r jag f&ouml;r att hitta den p&aring; enklaste s&auml;tt?<br /></strong>Om du g&aring;r in p&aring; &rdquo;BOKNINGAR&rdquo; under huvudmenyn &rdquo;MIN PROFIL&rdquo; finns det ett s&ouml;kf&auml;lt.<br />Skriv in platsen du vill veta mer om.<br />Om en tr&auml;ff kommer upp p&aring; platsen betyder det att platsen &auml;r prelimin&auml;rbokad och beh&ouml;ver hanteras.<br /><br /><br /></li>\r\n<li><strong>N&auml;r jag f&aring;r upp en lista och vill sortera den efter en s&auml;rskild kolumn (ex. namn eller e-postadress) - vad beh&ouml;ver jag g&ouml;ra?<br /></strong>N&auml;r du har en lista &ouml;ver t.ex. utst&auml;llare framme och vill sortera dem efter f&ouml;retagens namn g&aring;r du till den aktuella kolumnen och trycker p&aring; rubriken h&ouml;gst upp p&aring; listan. N&auml;r du tryckt p&aring; kolumnens rubrik sorteras listan automatiskt fr&aring;n l&auml;gst till h&ouml;gst (A-&Ouml;, 0-100 osv.)<br /><br /><br /></li>\r\n<li><strong>Jag vill exportera en eller flera utst&auml;llares f&ouml;retagsinformation f&ouml;r att skapa en faktura.</strong><br />Chartbooker Fair System kan exportera alla utst&auml;llares f&ouml;retagsinformation till formatet microsoft excel-dokument. <br />1. G&aring; till huvudmenyn och h&aring;ll muspekaren &ouml;ver "MIN PROFIL". Klicka sedan p&aring; "MINA EVENT" i undermenyn. <br />2. Du f&aring;r nu upp en lista p&aring; alla dina event. Leta reda p&aring; det eventet som du vill jobba med. N&auml;r du hittat det r&auml;tta eventet, klicka p&aring; knappen "Utst&auml;llare".<br />3. Nu visas en lista p&aring; alla utst&auml;llare som anm&auml;lt sitt intresse till eventet. Markera de utst&auml;llare du vill exportera information ifr&aring;n.<br />4. Klicka p&aring; knappen "Exportera till Exceldokument" som ligger positionerad h&ouml;gst upp p&aring; listan. V&auml;lj de kategorier du vill exportera information ifr&aring;n.<br />5. N&auml;r du &auml;r klar, klicka p&aring; knappen "Exportera till Exceldokument".<br /><br /><br /></li>\r\n<li><strong>Hur l&auml;nge ligger mitt event kvar efter att det har slutf&ouml;rts?</strong><br />Ditt event ligger uppe synlig f&ouml;r allm&auml;nheten 30 dagar efter eventets slutdatum. Eventet kommer sedan att bli osynligt f&ouml;r utst&auml;llare och bes&ouml;kare men fortfarande existera i din lista. F&ouml;r att l&aring;sa upp ditt event igen (f&ouml;rslagsvis till n&auml;sta upplaga), kontakta oss p&aring; Chartbooker International!</li>\r\n</ol>\r\n<p>&nbsp;</p>'),
('help_organizer', 'de', '<h2>FAQ</h2>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol>\r\n<li><strong>Wie finde ich einen bestimmten Aussteller bei einer Veranstaltung?</strong><br />Antwort: auf der rechten Seite der Karte ist eine Liste der Aussteller. Verwenden Sie das Suchfeld in der oberen H&auml;lfte der Liste und geben Sie den Namen des Ausstellers, die Sie suchen.<br /><br /></li>\r\n<li><strong>Ich m&ouml;chte nur sehen, eine Art von Emittenten (zB nur PC-Zubeh&ouml;r) auf der Karte. Wie kann ich?</strong><br />Antwort: auf der rechten Seite der Karte ist eine Liste der Aussteller. In der oberen H&auml;lfte - die Suchleiste - gibt es eine Liste, mit der Sie die Ausstellung &uuml;ber Aussteller in einer speziellen Kategorie sehen k&ouml;nnen.<br /><br /></li>\r\n<li><strong>Ich m&ouml;chte einen Administrator, um meine Veranstaltung erstellen. Wie kann ich?</strong><br />1. Im Hauptmen&uuml; gibt es einen Reiter namens "Administratoren" (US-Administratoren). Klicken Sie auf diese.<br />2. Sie sehen die Liste der Administratoren. Wenn Sie haben noch keine da, bevor es au&szlig;er einer Schaltfl&auml;che namens leer erstellt "Create new Administrator." Klicken Sie auf diese.<br />3. F&uuml;llen Sie das Anmeldeformular auf Ihren neuen Administrator und w&auml;hlen Sie dann, welche Ereignisse er, indem Sie die verschiedenen Veranstaltungen auf der rechten Seite des Browser-Fensters werden verabreichen ist.<br /><strong>HINWEIS! </strong>Wenn Sie den Fall, dass der Administrator Zugang zu haben zu w&auml;hlen, m&uuml;ssen Sie auch ticken die Karten ist er verantwortlich f&uuml;r.<br /><br /></li>\r\n<li><strong>Ich wei&szlig;, es gibt mehrere Ausstellungshallen, aber ich sehe nur die Karte von einer von ihnen. Wo finde ich die anderen?</strong><br />A: Neben der rechten oberen Ecke der Karte (die Aussteller), gibt es ein Feld namens "Maps". Wenn ein Handel hat mehr Karten, k&ouml;nnen Sie sie dort suchen.<br /><br /></li>\r\n<li><strong>Was passiert, wenn ein Aussteller Buch ein Ort?</strong><br />Als Aussteller w&auml;hlen vorl&auml;ufigen Buch ein Sitz H&auml;fen ihren Antrag unter "Neue Reservierungen" unter dem Hauptmen&uuml; "Mein Profil".<br />Der Ort, den sie gebucht haben, werden weiterhin in der Farbe gr&uuml;n (Leerlauf), bis der Operator oder Administrator hervorgehoben werden genehmigt Aussteller Anfrage.<br /><br /></li>\r\n<li><strong>Ich m&ouml;chte wissen, ob eine bestimmte Stelle ist vorl&auml;ufig gebucht, aber Schwierigkeiten haben, es in der Liste. Wie finde ich es am einfachsten?</strong><br />Wenn Sie "Neue Reservierungen" unter dem Hauptmen&uuml; zu gelangen "Mein Profil" gibt es ein Suchfeld.<br />Geben Sie den Ort, den Sie wollen mehr wissen.<br />Wenn ein Treffer kommt auf der Website bedeutet, dass die Website gebucht ist vorl&auml;ufig und m&uuml;ssen behandelt werden.<br /><br /></li>\r\n<li><strong>Wie l&ouml;sche ich eine Veranstaltung?</strong><br />Um unvorhergesehene Komplikationen zu vermeiden, m&uuml;ssen Sie uns per E-Mail oder Telefon zu kontaktieren, um ein Ereignis zu l&ouml;schen.<br /><br /></li>\r\n<li><strong>Ich habe einen fairen erstellt, wo ich meine Karte?</strong><br />Wenn Sie auf "Mein Profil" gehen -&gt; "Mein Fall" bringt alle Ereignisse, die Sie erstellt haben.<br />W&auml;hlen Sie die "Einstellungen" auf den Fall, Sie wollen, um eine Karte hinzuf&uuml;gen in.<br />Sie werden jetzt geben Sie die Einstellungen f&uuml;r Ihre Veranstaltung. Top der Seite ist ein Button, "Karten verwalten", sagt. Dr&uuml;cken Sie diese Taste zum Hinzuf&uuml;gen, Bearbeiten oder Entfernen von Karten f&uuml;r Ihre Veranstaltung.<br /><br /></li>\r\n<li><strong>Wenn ich eine Liste bekommen und wollen es nach einer bestimmten Spalte (zB Name oder E-Mail-Adresse) zu sortieren - was soll ich tun?</strong><br />Sobald Sie eine Liste solcher Aussteller kommen und wollen sie durch ihre Namen zu sortieren, um die aktuelle Spalte gehen und dr&uuml;cken Sie die Position an der Spitze der Liste.<br />Nach dem Dr&uuml;cken der Spalten&uuml;berschrift sortiert die Liste automatisch vom niedrigsten zum h&ouml;chsten (AZ, 0-100, etc.).</li>\r\n</ol>'),
('help_organizer', 'es', '<h2>FAQ</h2>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol>\r\n<li><strong>&iquest;C&oacute;mo puedo encontrar a expositores espec&iacute;ficos en un evento?</strong><br />Respuesta: en la parte derecha de su mapa es una lista de expositores. Utilice el campo de b&uacute;squeda en la parte superior de la lista y escriba el nombre del expositor que busca.<br /><br /></li>\r\n<li><strong>Quiero ver s&oacute;lo un tipo de emisores (por ejemplo, accesorios para PC solamente) en el mapa. &iquest;C&oacute;mo lo hago?</strong><br />Respuesta: en la parte derecha de su mapa es una lista de expositores. En la mitad superior - la barra de b&uacute;squeda - &iquest;Existe una funci&oacute;n de lista que le permite ver la exposici&oacute;n sobre los expositores en una categor&iacute;a especial.<br /><br /></li>\r\n<li><strong>Quiero crear un administrador para mi evento. &iquest;C&oacute;mo lo hago?</strong><br />1. En el men&uacute; principal hay una pesta&ntilde;a llamada "Administrators" (administradores de los Estados Unidos). Haga clic en este.<br />Segundo Ver&aacute; la lista de sus administradores. Si no ha creado ning&uacute;n puesto antes de que se vac&iacute;a a excepci&oacute;n de un bot&oacute;n llamado "Crear nuevo administrador." Haga clic en este.<br />Tercero Complete el formulario de registro para el nuevo administrador y luego seleccione los eventos que se va a administrar por el control de los diversos eventos en la parte derecha de la ventana del navegador.<br />NOTA! Cuando se selecciona el caso de que el administrador tendr&aacute; acceso a, tambi&eacute;n debe marcar los mapas que es responsable.<br /><br /></li>\r\n<li><strong>Yo s&eacute; que hay varias salas de exposiciones, pero s&oacute;lo ver el mapa de uno de ellos. &iquest;D&oacute;nde puedo encontrar a los otros?</strong><br />A: Al lado de la esquina superior derecha del mapa (los expositores), hay una caja llamada "Mapas". Si el comercio tiene m&aacute;s mapas, puede navegar por all&iacute;.<br /><br /></li>\r\n<li><strong>&iquest;Qu&eacute; pasa cuando un libro de un lugar expositor?</strong><br />Cuando los expositores eligen libro preliminar puertos de un asiento a su solicitud de conformidad con "nuevas reservas" en el men&uacute; principal de "Mi perfil".<br />El lugar en el que han reservado seguir&aacute; siendo resaltada en color verde (inactivo) hasta que el operador o un administrador ha aprobado la investigaci&oacute;n expositor.<br /><br /></li>\r\n<li><strong>Quiero saber si un determinado lugar es provisional reservado, pero tienen problemas para encontrarlo en la lista. &iquest;C&oacute;mo puedo encontrar la manera m&aacute;s f&aacute;cil?</strong><br />Si introduce "nuevas reservas" en el men&uacute; principal de "Mi Perfil" hay un campo de b&uacute;squeda.<br />Introduzca la ubicaci&oacute;n que desee saber m&aacute;s acerca de.<br />Si un golpe aparece en el sitio significa que el sitio es reservado preliminares y necesitan ser manejados.<br /><br /></li>\r\n<li><strong>&iquest;C&oacute;mo elimino un evento?</strong><br />Para evitar complicaciones imprevistas, es necesario ponerse en contacto con nosotros por correo electr&oacute;nico o por tel&eacute;fono para eliminar un evento.<br /><br /></li>\r\n<li><strong>He creado una feria, d&oacute;nde pongo mi mapa?</strong><br />Si usted va a "Mi perfil" -&gt; "Mi caso" nos lleva a todos los eventos que ha creado.<br />Seleccione la opci&oacute;n "Configuraci&oacute;n" en el caso de que desee a&ntilde;adir un mapa a.<br />Ahora va a entrar en la configuraci&oacute;n de su evento. Parte superior de la p&aacute;gina hay un bot&oacute;n que dice "Administrar mapas". Pulse este bot&oacute;n para agregar, editar o eliminar mapas para su evento.<br /><br /></li>\r\n<li><strong>Cuando llego a una lista y desea ordenar por una columna en particular (por ejemplo, nombre o direcci&oacute;n de correo electr&oacute;nico) - &iquest;qu&eacute; debo hacer?</strong><br />Una vez que tenga una lista de dicha expositores llegan y quieren resolver por su nombre, vaya a la columna actual y pulse el t&iacute;tulo en la parte superior de la lista.<br />Despu&eacute;s de pulsar la cabecera de columna ordena la lista autom&aacute;tica de menor a mayor (AZ, 0-100, etc.)</li>\r\n</ol>'),
('contact', 'eng', '<h2><span style="color: darkgreen;">It''s easy to have personal contact with us.<br /></span></h2>\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td><img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__3543255_orig.jpg" alt="Leif Wall&eacute;n" /><br /><span style="color: darkgreen;"><strong>Mr. Leif Wall&eacute;n</strong></span><br /><strong>Language:</strong> english, swedish, spanish&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br /><strong>mobile:</strong>+46(0)705-294662<br /><strong>E-mail:</strong> <a href="mailto:leif.wallen@chartbooker.com">leif.wallen@chartbooker.com</a></td>\r\n<td><img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__3277531_orig.jpg" alt="Eduardo Wall&eacute;n" /><br /><strong><span style="color: darkgreen;">Mr. Eduardo Wall&eacute;n</span></strong><br /><strong>Language:</strong> english, swedish<br /><strong>mobile:</strong> +46(0)707-386668<br /><strong>E-mail:</strong><a href="mailto:eduardo.wallen@chartbooker.com"> eduardo.wallen@chartbooker.com</a></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p><img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__2350287_orig.jpg" alt="Susana Herbozo" /><br /><strong><span style="color: darkgreen;">Mrs. Susana Herbozo</span></strong><br /><strong>Language:</strong> spanish, swedish<br /><strong>mobile:</strong> +46+(0)702-584709<br /><strong>E-mail:</strong> <a href="mailto:info@chartbooker.com">info@chartbooker.com</a></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n<td>\r\n<p><img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__3277531_orig.jpg" alt="Alexis Wall&eacute;n" /><br /><strong><span style="color: darkgreen;">Mr. Alexis Wall&eacute;n</span></strong><br /><strong>Language:</strong> english, swedish<br /><strong>mobile:</strong> +46(0)76-0508882<br /><strong>E-mail:</strong> <a href="mailto:alexis.wallen@chartbooker.com">alexis.wallen@chartbooker.com</a></p>\r\n<strong><br /></strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td><img src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__4701980.png" alt="" width="100" height="100" /></td>\r\n<td>\r\n<p><span style="color: darkgreen;"><strong>Office</strong></span><br /><strong>Phone:</strong> +46(0)19-294690<br /><strong>Telefax:</strong> +46(0)19-294662<br /><strong>E-mail:</strong> info@chartbooker.com <br /><strong>Internet:</strong><a href="http://www.chartbooker.com">www.chartbooker.com</a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>');
INSERT INTO `page_content` (`page`, `language`, `content`) VALUES
('help', 'eng', '<p><strong>THE STAND SPACES DIFFERENT COLOURS SHOWS A STAND SPACE TEMPORARY STATUS</strong></p>\r\n<p>Drag your mouse over the coloured spots to reveal information about the stand space.<strong><br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_open.png" alt="" /> = Free stand space<br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_reserved.png" alt="" /> = Reserved stand space<br /></strong></p>\r\n<p><strong> <img src="../../../images/icons/marker_booked.png" alt="" /> = Booked stand space<br /></strong></p>\r\n<p><strong><img src="../../../images/icons/marker_applied.png" alt="Prelimin&auml;rbokad plats" /> = Preliminary booked stand space (only visible for the Exhibitor him/herself)<br /></strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<ol>\r\n<li><strong>How to become a NEW EXHIBITOR:<br /><br /></strong>1. Navigate to &rdquo;NEW USER?&rdquo; in the main menu on the upper part of your browser.<br />2. Enter your personal information; all text fields marked with an * are required to proceed.<br />3. Enter the username you wish your account to have in the field &rdquo;Username&rdquo;. This is the name you use when you log in to your account.<br />4. You will now get a password sent to your e-mail adress.<br />5. Click the activation link in the mail.<br />6. Finished! You can now log in to book a stand space. (see issue No. 3)<br /><br />IMPORTANT &ndash; BE SURE TO ALWAYS SAVE YOUR USERNAME AND PASSWORD!<br />The username and password is needed to log in to your account in Chartbooker Fair System. <br />Your account is needed when you want to book a stand space at an event. <br />You can use the same account no matter which event you choose as long as it uses Chartbooker Fair System.s<br /><br /><br /></li>\r\n<li><strong>Map overview:</strong><br /> <br />You can see an event&rsquo;s map whenever you choose by pressing &rdquo;VIEW MAP&rdquo; in the main menu after you&rsquo;ve registered your account to the event.<br /><strong>In case you have registered to several different events:</strong> <br />Hover your mouse pointer over the button &ldquo;EVENTS&rdquo; and click on the event you want to work with. Then, click on &ldquo;VIEW MAP&rdquo;.<br /><br /><br /></li>\r\n<li><strong>How to book a stand space:</strong><br /><br />All exhibitors can preliminary book a free stand space (green dot) of their own choosing.<br />This is done by left-clicking on the concerned space and choose "preliminary book stand space".<br />When you - the exhibitor - have chosen a place, the system will send an e-mail with your request to the organizer.<br />Each free stand space can be preliminary booked by several different exhibitors.<br />It is always the organizer who makes the final decision of which exhibitor that is best suited for the stand space.<br /><br /></li>\r\n<li><strong>Exhibitor list:<br /><br /></strong>On the right side of the event&rsquo;s map there is an exhibitor list. This list shows which exhibitors that have been assigned a stand space.<br />Use the search field if there is a certain exhibitor you are searching for.<br />You will automatically be moved to the chosen exhibitor&rsquo;s stand space if you click on the exhibitor&rsquo;s name in the list.<br />Use the list to plan your request concerning a stand space more thoroughly.<br /><br /><br /></li>\r\n<li><strong>How to switch between events (how to use the button &rdquo;EVENT&rdquo;):</strong><br />\r\n<p>All the events you&rsquo;ve registered to are gathered here. <br />As soon as you have registered to an event it is placed as a selectable alternative in the sub-menu. <br />Here you can choose which event you want to work with at the moment. <br />You can only work with one event at the time, but you can switch freely whenever and as many times as you want.<br /><br /><br /><br /><br /></p>\r\n</li>\r\n</ol>\r\n<h2>FAQ - Frequently asked questions</h2>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li><strong>Where do I change languages?</strong><br /><br />Answer: You can choose between the following languagues: swedish, english, spanish and german.<br /> Change language by pressing the flag in the upper right corner of the browsers workspace.<br /><br /><br /></li>\r\n<li><strong>Forgot your username or password?</strong><br /><br />Answer: If you have forgotten your username or password to your account, follow these steps:<br /><br />1. Press &rdquo;LOG IN&rdquo;.<br />2. Click on the link &ldquo;Forgot your username or password?&rdquo; in the login window.<br />3. You will be brought to a page with a single text field after you have clicked the link.<br />4.Write either the username or e-mail adress belonging to your account.<br />5. You will now recieve an e-mail containing your username and a new password.<br /><br />The password can be changed whenever you choose to by holding the mouse pointer over &ldquo;MY PROFILE&rdquo; in the main menu, then choosing &ldquo;CHANGE PASSWORD&rdquo;.<br /><br /><br /></li>\r\n<li><strong>Why doesn''t the map show properly?</strong><br /><br />Answer: Try updating the page (F5) or clear your cache (press ctrl + shift + delete and select to delete your temporary internet files).</li>\r\n</ol>\r\n<p>&nbsp;</p>'),
('help_organizer', 'eng', '<h2>FAQ</h2>\r\n<ol>\r\n<li><strong>How do I find a particular exhibitor when I''m loking at a map of my event?</strong><br />Answer: On the right side of the map area there is a list of exhibitors. <br />Use the search field on the top side of the list to write in the name of the exhibitor you are searching for.</li>\r\n<li><strong>I want to be able to sort exhibitors after a special category. How do I do this?</strong><br />Answer: On the right side of the map area there is a list of exhibitors. <br />If you look at the top of the list (above the search field) there is a list function that says &ldquo;Filter by category&rdquo;. <br />Click there and you will be able to filter the exhibitors by a chosen category.</li>\r\n<li><strong>I know there are several exhibition halls, but I can see the map only on one of them. Where are the others?</strong><br />Answer: On the right side of the map area there is a list of exhibitors. <br />If you look further up above the exhibitor list there is a separate box called &rdquo;Maps&rdquo;. <br />Press the list function and you will be able to see all the maps linked to this event.</li>\r\n<li><strong>What happens when an exhibitor preliminary book a stand space?</strong><br />Answer: When an exhibitor choose to preliminary book a stand space their request will be placed in the sub-menu &rdquo;NEW RESERVATIONS&rdquo;. <br />This sub-menu appears when the mouse hovers over &ldquo;MY PROFILE&rdquo; in the main menu. <br />The booked stand space continues to appear in the color green (vacant) until an administrator approves the exhibitors booking request</li>\r\n<li><strong>How do I delete an event?</strong><br />Answer: If an organizer wants to delete an event, he/she need to contact us on Chartbooker International through e-mail or a phone call. <br />This is to avoid unforeseen complications.</li>\r\n<li><strong>I have created an event. How do I upload my map?</strong><br />Answer: If you choose &rdquo;MY PROFILE&rdquo; &agrave; &rdquo;MY EVENTS&rdquo;, a list of all events you have created will be shown. <br />Click the &ldquo;settings&rdquo;-button on the event you want a map uploaded to. <br />You will now enter the settings for the selected event. <br />On the top of the page there is a button called &rdquo;Handle maps&rdquo;. <br />Click the button to upload, edit or remove maps to your event.</li>\r\n<li><strong>How do I add an administrator to an event?</strong><br />Click on &rdquo;ADMINISTRATORS&rdquo; in the main menu and then choose &rdquo;Create new administrator&rdquo;. <br />Write the relevant information you need about the administrator and then choose which events he or she has authorization to edit. An administrator can be assigned as responsible for an unmlimited amount of maps and events.</li>\r\n</ol>');
