(458, 'Jafaris', '', 'Jafaris Group AB', '556694-0796', 'Källebacksvägen 16', '555 93', 'Jönköping', 'Jafaris Group AB', 'Källebacksvägen 16', '555 93', 'Jönköping', 'peter@jafaris.se', 'Sweden', 'Sweden', '<p><strong>Jafaris Group</strong> har varit verksam p&aring; marknaden i snart 20 &aring;r.<br />Det har gett oss otroligt mycket erfarenhet och bredd p&aring; marknaden.<br />V&aring;r verksamhet avser f&ouml;rs&auml;ljning av snabbmat och bageriprodukter fr&aring;n v&aring;ra moderna fordon.<br />Vi finns p&aring; m&aring;nga olika marknader, festivaler och m&auml;ssor. Inget sammanhang &auml;r f&ouml;r sm&aring;tt eller f&ouml;r stort f&ouml;r oss!<br />Jafaris str&auml;cker sig &ouml;ver hela Sverige och vi &auml;r k&auml;nda f&ouml;r v&aring;ra fina, fr&auml;scha vagnar och delikata bakverk. <br />Trevlig och professionell personal ser vi som en sj&auml;lvklarhet!<br />Till v&aring;r stora gl&auml;dje kommer v&aring;ra kunder tillbaka, &aring;r efter &aring;r.</p>\r\n<p><strong>V&auml;lkommen du ocks&aring;! </strong>h&auml;lsar Peter Al Jafari med personal<br />&nbsp;<img src="http://i.imgur.com/GiU1bVU.jpg" alt="" width="347" /></p>', 0, '070-5763646', '070-576 36 46', '', '070-5763646', 'peter@jafaris.se', '036-390113', 'http://www.jafaris.se', 'peter@jafaris.se', '$2a$12$aXQFm.9gR/JCe.HQ567f6Oh3r6LON9GxIlwuuDO6IfUH49koKQ8FS', 'Peter Al Jafari', '1', 0, 1361261536, 1394398403, 4, 1393940431, 0, 'munkar,slush,sockervadd,canderade äpple,mjukglass,läsk och kaffe /\r\nEndast Kebab,hamburgare,piroger,strips och läsk vid platsen vid marknads kontoret'),
