(655, 'joakim@fryksdalensfarfarm.se', '', 'Fryksdalens Fårfarm AB', '556636-7198', 'Säljebacka 46', '686 95', 'Västra Ämtervik', 'Fryksdalens Fårfarm AB', 'Säljebacka 46', '686 95', 'Västra Ämtervik', 'joakim@fryksdalensfarfarm.se', '', 'Sweden', 'I Säljebacka, några kilometer söder om Västra Ämtervik, ligger gården Hagen naturskönt placerad mellan Frykstahöjden och Fryken. Där, på Fryksdalens Fårfarm, lever familjen Lundgren med sina drygt 300 tackor och bedriver en KRAV-godkänd lammuppfödning.\r\n\r\nÅrligen föds mellan 500-600 lamm. Dessa föds varsamt upp på i huvudsak gräs och slaktas i ett närbeläget slakteri under lugna former vid 10-14 månaders ålder.\r\n\r\nFrom 2012 pågår också egen förädling av lamm- och fårkött i egen gårdschark. Försäljning sker i egen gårdsbutik. ', 0, '+46 70 377 74 37', '', '', '', '', '', 'www.fryksdalensfarfarm.se', 'joakim@fryksdalensfarfarm.se', '$2a$12$aXQFm.9gR/JCe.HQe9992ORZN3ywCSBdN6Wtzxq5SxtL.LQzcss6S', 'Joakim Lundgren', '1', 0, 1361783763, 1361954870, 4, 1361783763, 0, 'Gårdsproducerat kött och chark av egenuppföda lamm och får. Fårs'),
