(661, 'dosmundos', '', 'Dos Mundos Trading HB', '969749-6819', 'Bastugatan 39, 1tr', '11825', 'Stockholm', 'Dos Mundos Trading HB', 'Bastugatan 39, 1tr', '11825', 'Stockholm', 'dosmundos11@hotmail.com', '', 'Sverige', 'Dos Mundos Trading är en importfirma som tar in kvalitetsvaror från hela världen. Vi säljer minigitarrer, silver, etniska textilier och träfigurer m m.\r\nVi säljer på marknader men även på mässor som grossister. Vi har en lång erfarenhet av import och har trovärdiga leverantörer samt en välfungerande logistik. Vi satsar på att främja det etniska och alltid med ett miljötänkande i botten.', 0, '08-6692955', '073-839 15 83', '', '', '', '', 'http://dosmundos.se', 'dosmundos11@hotmail.com', '$2a$12$aXQFm.9gR/JCe.HQd785bubEMNhPwMkhsRkASqZB4oZ3hxUmAqSfu', 'Ulf Nordström', '1', 0, 1361822021, 0, 0, 1361822021, 0, 'Miniguitarrer i trä, silversmycken, veteranhjälmar för moped, mc'),
