(665, 'Nercia Bemanning', '', 'Nercia Bemanning AB', '556894-6072', 'Tunnlandsgatan 5', '703 46', 'Örebro', 'Nercia Bemanning AB', 'Box 14055', '70014', 'Örebro', 'rickard@nercia.se', '', 'Sverige', 'Nercia är ett privatägt företag och har funnits på marknaden sedan 1986 och är kvalitetscertifierade enligt ISO 9001:2008. Vi finns på ett flertal orter i Mellansverige men genomför uppdrag i hela Sverige. I vår värdegrund är relation vårt främsta ledord. En god relation är utgångspunkten i alla våra tjänster. Genom vårt breda utbud av tjänster blir vi en komplett partner för personal och kompetensutveckling.\r\n\r\nBemanning/Rekrytering\r\nNercia är en leverantör inom Bemanning och Rekrytering som erbjuder dig högt kvalitativa lösningar. Vi rekryterar och bemannar både längre och kortare uppdrag utifrån era önskemål. Nercia erbjuder tjänster inom yrkesområdena: lager, industri, bygg/anläggning, kontor, el, teknik, expertis med mera. Vi är genom Almega Bemanningsföretagen utsedda auktoriserat bemanningsföretag och har kollektivavtal med LO och Unionen.\r\n\r\nFöretagsanpassade program\r\nAtt komponera företagsanpassade och målstyrda program för kompetensutveckling är en av våra främsta styrkor. Vi har genom åren gjort det för många olika typer av företag och offentliga verksamheter. I ett sådant program står alla möjligheter öppna. Efter en inledande presentation och måldialog med kunden, fastställs utbildningens innehåll och syfte. Med mera än 140 utbildare erbjuds en bred kompetensplattform för våra utbildningar*.\r\n\r\nYrkeskraft\r\nVåra yrkesutbildningar är utbildningsprogram som byggts i samarbete med företag. Hittills har vi, på uppdrag från Arbetsförmedlingen, yrkesutbildat mer än 3 000 personer. Genom åren har i snitt 80 % av våra deltagare fått anställning inom 90 dagar efter utbildningen. I utbildningarna samarbetar vi med företag inom branscher som processindustri, tillverkningsindustri, elinstallation med mera. De yrken det handlar om är inom service och underhåll, industri-,\r\ninstallation- och distributionselektriker, operatörer inom process, underhållstekniker/reparatör, automationstekniker, fastighetstekniker med mera.\r\n\r\nKarriärsprogram/Öppna utbildningar\r\nVåra karriärsprogram inom marknadsföring och management är längre utbildningar och vänder sig till personer som siktar på, eller redan har en ledande befattning. Utformningen är sådan att deltagaren kan kombinera studier och arbete och på så sätt förankra sina kunskaper i verkligheten. Utbildningen ger en unik möjlighet att skapa ett nätverk som man har glädje av under lång tid, både affärsmässigt och privat. Vi har även kortare utbildningar inom en rad områden. Ibland är det svårt att samla tillräckligt många deltagare till en specialistutbildning inom ett och samma företag, särskilt om företaget är relativt litet. Då kan man i stället använda våra öppna program. Vi erbjuder sådana program inom försäljning,\r\nmarknadsföring, ledarskap, projekt, ekonomi och teknik.\r\n\r\n*dessa utbildare är även kandidater för vår bemanningsverksamhet.\r\n', 0, '019-206700', '', '', '', '', '', 'http://www.nercia.se', 'ansokan@nercia.se', '$2a$12$aXQFm.9gR/JCe.HQbbde9up3Np6cVuW6h1mlJBMz0xabu7HjRgHQ2', 'Rickard Algotsson', '1', 0, 1362057553, 0, 0, 1362057553, 1, 'Bemanning/Rekrytering'),
