(742, 'carlito', '', 'Azzuri moda', '6310182859 ', 'Söderleden 3 ', '58722', 'Linköping ', 'Azzuri moda', 'Söderleden 3 ', '587 22 ', 'Linköping ', 'arricalecarmine@hotmail.com', '', 'Sverige', 'Azzuri moda, grundat av italienske charmören Arricale Carmine, har lång erfarenhet av attraktiva modeprodukter av hög kvalité. Våra populära modeväskor är av Italiensk design i starka och glada färger. Benvenuto!', 0, '0733600575', '0733600575', '', '', '', '', '', 'arricalecarmine@hotmail.com', '$2a$12$aXQFm.9gR/JCe.HQ1342fuCcichjQlBg/NY1ZrSupurhOwG5f8gS6', 'Arricale Carmine', '1', 0, 1368622021, 0, 0, 1368622021, 0, 'Modeväskor av hög kvalité. Italiensk design i starka glada färg'),
(743, 'exhibitor31', '', 'Bofors Test Center', '123456-7890', 'Jakthornsgatan 42', '123 45', 'Karlskoga', 'Bofors Test Center', 'Jakthornsgatan 42', '123 45', 'Karlskoga', 'exhibitor31@chartbooker.com', '', 'Sverige', 'Bofors Test Center bedriver provningsverksamhet främst åt försvarsindustrin och explosivämnesbranchen. \r\nVi provar allt från delsystem till kompletta system; vi genomför provning under hela en produkts livscykel och även inom miljötålighet. \r\nVi finns i Karlskoga.', 0, '-', '-', '', '', '', '', 'http://www.testcenter.se/', 'exhibitor31@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ942fbOtFB0C3Ol2IPoJbV5FkI7kk0hjqpynfO', 'Arne Krakus', '1', 0, 1369043485, 0, 0, 1369043485, 0, 'Vi vill gärna träffa studenter inom ingenjörsprogrammen.'),
(744, 'exhibitor32', '', 'Drivhuset', '123456-7890', 'Örebro universitet', '123 45', 'Örebro', 'Drivhuset', 'Örebro universitet', '123 45', 'Örebro', 'exhibitor32@chartbooker.com', '', 'Sverige', '<p>Under 2012 erbjuder Drivhuset riktade insatser f&ouml;r dig som &auml;r kvinna och vill starta&nbsp;f&ouml;retag, eller utveckla ett redan befintligt&nbsp;f&ouml;retag. <br />N&auml;r det g&auml;ller starta f&ouml;retag vill vi&nbsp;s&auml;rskilt n&aring; kvinnliga studenter vid institutionen f&ouml;r humaniora samt institutionen f&ouml;r&nbsp;juridik, psykologi och socialt arbete.</p>\r\n<p>&nbsp;</p>\r\n<p>Drivhuset &auml;r en plattform f&ouml;r dig som vill utveckla entrepren&ouml;riellt driv. Genom personlig evolution och aff&auml;rsutveckling vill vi f&aring; fler att skapa nytt av sina id&eacute;er. Drivhuset arbetar h&ouml;gskolen&auml;ra &ouml;ver hela landet. Resultatet &auml;r livskraftiga f&ouml;retag som &auml;r redo f&ouml;r framtiden. Drivhusets mission &auml;r att skapa kreativ kraft, s&aring; att m&auml;nniskor kan starta, driva och utveckla f&ouml;retag. Genom personlig evolution och aff&auml;rsutveckling vill vi helt enkelt f&aring; fler att skapa n&aring;got nytt av sina id&eacute;er. Fokus ligger p&aring; dig som entrepren&ouml;r inte p&aring; id&eacute;n, f&ouml;r id&eacute;er bed&ouml;mer vi aldrig. M&aring;let &auml;r att du som entrepren&ouml;r och f&ouml;retagare f&aring;r de verktyg som beh&ouml;vs f&ouml;r att n&aring; dit du vill. D&auml;rf&ouml;r finns vi som ett bollplank &aring;t dig. Av oss kan du f&aring; v&auml;gledning, utbildning och tillg&aring;ng till en kontorsmilj&ouml;, allt utifr&aring;n ditt eget behov.</p>', 0, '-', '-', '-', '', '', '-', 'http://www.drivhuset.se', 'exhibitor32@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQb8498O9fCAxevYqG0RTfmBhTC.U44DWTkKdtm', 'Vera Svensson', '1', 0, 1369045031, 1369046730, 1, 1369045031, 0, 'Kontaktsamtal'),
(745, 'exhibitor33', '', 'Ernst & Young', '123456-7890', 'Prästgatan 39', '123 45', 'Örebro', 'Ernst & Young', 'Prästgatan 39', '123 45', 'Örebro', 'exhibitor33@chartbooker.com', '', 'Sverige', 'Ernst & Young är en ledande global aktör inom revision, skatt, transaktioner, rådgivning och redovisning. Våra 152 000 medarbetare världen över förenas av gemensamma värderingar och en stark vilja att leverera tjänster av högsta kvalitet. \r\nVår drivkraft är att hjälpa medarbetare, kunder och den omvärld vi verkar i att uppnå sin fulla potential. I Sverige har vi drygt 60 kontor och har cirka 2 100 medarbetare. Eftersom vår verksamhet omfattar flera olika specialistområden, branscher och geografiska marknader har våra medarbetare många utvecklingsmöjligheter! Du kan till exempel arbeta som revisor, skattekonsult, analytiker eller managementkonsult i Sverige eller utomlands.', 0, '019-165165', '070-5081586', '', '', '', '', 'www.ey.com', 'exhibitor33@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ7e351emgrIW7iMMGo1dzGkNXnXQt5WvQG3B2q', 'Ebba Lindström', '1', 0, 1369069338, 0, 0, 1369069338, 0, 'Tillsvidareanställning, Praktik, Examensarbete, Nätverk'),
(746, 'exhibitor34', '', 'Humana', '123456-7890', 'Apoteksvägen 8D', '123 45', 'Örebro', 'Humana', 'Apoteksvägen 8D', '123 45', 'Örebro', 'exhibitor34@chartbooker.com', '', 'Sverige', 'Humana är Sveriges största företag inom personlig assistans med verksamhet över hela landet. För oss räcker det dock inte med att bara vara störst, vi vill vara bäst också. Därför strävar alla vi som arbetar inom Humana varje dag\r\nefter att göra skillnad. I över tio år har vi arbetat inom affärsområdet personlig assistans med utgångspunkten att sätta människan i centrum, inte\r\nfunktionsnedsättningen. Inom Humana finns även verksamheter inom LSSboenden, äldreomsorg, individ- och familjeomsorg samt skola för elever med funktionsnedsättning. Vi är 8 000 medarbetare som arbetar efter samma vision, ”Alla har rätt till ett bra liv”.', 0, '019-706 86 00', '', '', '', '', '', 'www.humana.se', 'exhibitor34@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQb32a9eAnfammOaeb60HfTFlbyBGIngCs5Zo1S', 'Alexandra Molin', '1', 0, 1369069465, 0, 0, 1369069465, 0, 'Praktik, Sommarjobb, Extrajobb'),
(747, 'exhibitor35', '', 'Nethouse', '123456-7890', 'Drottninggatan 25C', '123 45', 'Örebro', 'Nethouse', 'Drottninggatan 25C', '123 45', 'Örebro', 'exhibitor35@chartbooker.com', '', 'Sverige', 'Nethouse är ett företag startat med drömmen om att bygga ett annorlunda It-bolag. Vi har en stark företagskultur som bygger på våra fyra kärnvärden, engagemang, kompetens, ödmjukhet och lönsamhet. För oss är det viktigt att ha roligt på jobbet och att ha en bra balans mellan arbete och fritid. Vi arbetar tillsammans i en öppen och kreativ miljö där vår framåtanda och vårt engagemang gör skillnad för de kunder vi arbetar tillsammans med. Nethouse levererar lösningar till både privata och offentliga uppdragsgivare. Vi har lång erfarenhet av affärs- och verksamhetsutveckling, infrastruktur och systemutveckling. För oss är våra medarbetare och kunder våra viktigaste tillgångar och vi arbetar med moderna metoder för att förverkliga de möjligheter som IT erbjuder.', 0, '019-16 40 00', '', '', '', '', '', 'www.nethouse.se', 'exhibitor35@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQe1c32uNYGRxyB/cbnR0meebxacQkC/X1a4/q2', 'Joakim Alkman', '1', 0, 1369069601, 0, 0, 1369069601, 0, 'Tillsvidareanställning, Praktik, Nätverk, Examensarbete'),
(748, 'exhibitor36', '', 'Poolia', '123456-7890', 'Tvärgatan 25', '123 45', 'Örebro', 'Poolia', 'Tvärgatan 25', '123 45', 'Örebro', 'exhibitor36@chartbooker.com', '', 'Sverige', 'Varje år genomför vi tusentals rekryteringar och konsultuppdrag. Eftersom vi har nära samarbeten med många av Sveriges mest attraktiva företag kan vi erbjuda dig spännande möjligheter. Oavsett om du väljer att arbeta som\r\nkonsult hos oss eller vill bli rekryterad av någon av våra kunder, så är Poolia den perfekta karriärpartnern. Våra rekryterare och konsultchefer har själva bakgrund inom den bransch de rekryterar till eller har konsultansvar inom. Det gör att vi kan förstå just din kompetens och vad du kan tillföra en verksamhet och att du kan känna dig trygg i att du är rätt person på rätt plats. Vi fungerar som ett bollplank genom hela processen och ger dig en ärlig bild av det aktuella företaget och tjänsten du söker. På Poolia finns även möjligheter till arbete internationellt eftersom vi har verksamhet runtom i Europa.', 0, '070 275 96 89', '', '', '', '', '', '', 'exhibitor36@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ1170euDte15rdkbzwddd4nRJpeKvIIsxCmCeS', 'Olle Oijen', '1', 0, 1369069733, 0, 0, 1369069733, 0, 'Tillsvidareanställning, Sommarjobb, Extrajobb, Examensarbete, Pr'),
(749, 'exhibitor37', '', 'Statistiska Centralbyrån (SCB)', '123456-7890', 'Järngatan 15', '123 45', 'Örebro', 'Statistiska Centralbyrån (SCB)', 'Järngatan 15', '123 45', 'Örebro', 'exhibitor37@chartbooker.com', '', 'Sverige', 'Statistiska centralbyrån, SCB, är en förvaltningsmyndighet. Vår främsta uppgift är att förse kunder med statistik för beslutsfattande, debatt och forskning. Det gör vi främst på uppdrag av regeringen och olika myndigheter men\r\nvi har även kunder inom det privata näringslivet och bland forskare. Förutom att framställa och kommunicera våra statistiska data har vi som uppgift att stödja och samordna det svenska systemet för officiell statistik. Vi medverkar också i det internationella statistiska samarbetet. SCB har i årsmedeltal 1 385 medarbetare. Ungefär 541 personer arbetar i Stockholm och 690 i Örebro. Det finns också 154 fältintervjuare som arbetar runt om i landet. Medelåldern vid SCB är 45 år för både kvinnor och för män. Vi har en medelanställningstid vid SCB på 14 år.', 0, '019-17 60 00', '', '', '', '', '', 'www.scb.se', 'exhibitor37@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ3c45cub0G8LNnl5FkRflWdxag6CrJ968RDy1G', 'Lotta Lejerwik', '1', 0, 1369070063, 0, 0, 1392107260, 0, 'Tillsvidareanställning, Praktik, Sommarjobb, Examensarbete'),
(750, 'exhibitor38', '', 'Transportstyrelsen', '123456-7890', 'Rostagatan 25', '123 45', 'Örebro, Hela landet', 'Transportstyrelsen', 'Rostagatan 25', '123 45', 'Örebro, Hela landet', 'exhibitor38@chartbooker.com', '', 'Sverige', 'Transportstyrelsens vision är: vi skapar trygghet på land, till sjöss och i luften. I Örebro finns huvuddelarna av fyra avdelningar. Förutom myndighetens IT-avdelning som arbetar med it-arkitektur, systemutveckling, förvaltning och drift av it-system samt infrastruktur finns också Körkortsavdelningen, Transportregistret och Skatte- och avgiftsavdelningarna här. I de båda sistnämnda arbetar man med att förvalta och utveckla vägtrafikregistret, ett datorbaserat besluts- och informationssystem, som innehåller information om landets alla fordon, körkort och all yrkestrafik samt fordons- och trängselskatter samt vägavgifter. På körkortsavdelningen utreder vi och fattar beslut om rätten att ha körkort.', 0, '010 495 61 68', '', '0771 503 503', '', '', '', 'www.transportstyrelsen.se', 'exhibitor38@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ862cfu39UTtzJMCCkw5j02oGrlFNl7FrtUu46', 'Per-Olov Rahm', '1', 0, 1369071404, 0, 0, 1369071404, 0, 'Tillsvidareanställning, Traineeplats, Praktik, Sommarjobb, Exame'),
(751, 'exhibitor39', '', 'Academic Work', '123456-7890', 'Forskarvägen 1', '702 18', 'Örebro', 'Academic Work', 'Forskarvägen 1', '702 18', 'Örebro', 'exhibitor39@chartbooker.com', '', 'Sverige', 'Academic Work är Home of the Young Professionals, ett företag som arbetar med personaluthyrning och rekrytering av studenter och unga akademiker. Vi är ett företag som det dessutom går väldigt bra för. Det är inte längesedan vi var tre personer med pannrum på Kungliga Tekniska Högskolan som kontor.', 0, '020 37 38 40', '', '', '', '', '', 'www.academicwork.se', 'exhibitor39@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ9577cOITTAp3imKnjGrG2kzChXcSOvJCxISpW', 'Ingvar Hansson', '1', 0, 1369071540, 0, 0, 1369071540, 0, 'Tillsvidareanställning, Traineeplats, Praktik, Sommarjobb, Extra'),
(752, 'exhibitor40', '', 'Adecco', '123456-7890', 'Fabriksgatan 2', '123 45', 'Örebro, Hela landet', 'Adecco', 'Fabriksgatan 2', '123 45', 'Örebro, Hela landet', 'exhibitor40@chartbooker.com', '', 'Sverige', 'Adecco, med huvudkontor i Zürich, Schweiz, är världens ledande leverantör av HR-lösningar. Med över 5 700 kontor i mer än 60 länder runt om i världen erbjuder Adecco ett brett utbud av tjänster och binder samman mer än 500,000 medarbetare med över 100,000 kunder varje dag. De tjänster som erbjuds delas in i huvudkategorier av personaluthyrning, rekrytering, outsourcing och coachning av chefer och arbetssökande. Adecco är ett Fortune Global 500-företag. I Sverige är Adecco ett auktoriserat bemanningsföretag som för närvarande har ca 50 kontor och 5,000 anställda.', 0, '031 725 45 00', '073 684 75 42', '', '', '', '', 'www.adecco.se', 'exhibitor40@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ3cdf7OuI8rOPtuSRjyFBKnYQhR6kpSeUTS.92', 'Frida Hallström', '1', 0, 1369071652, 0, 0, 1369071652, 0, 'Tillsvidareanställning, Extrajobb, Sommarjobb, Jobbcoachning'),
(753, 'exhibitor41', '', 'Atlas Copco', '123456-7890', 'Gustavsviksvägen 15', '123 45', 'Örebro, Hela landet', 'Atlas Copco', 'Gustavsviksvägen 15', '123 45', 'Örebro, Hela landet', 'exhibitor41@chartbooker.com', '', 'Sverige', 'Atlas Copco är en industrikoncern med världsledande ställning inom kompressorer, anläggnings- och gruvutrustning, industriverktyg och monteringssystem. Koncernen erbjuder hållbara lösningar med innovativa produkter och tjänster som ökar kundernas produktivitet. Atlas Copco har en intern arbetsmarknad där samtliga lediga jobb inom koncernen läggs ut. Hos Atlas Copco har man möjlighet att göra en spännande karriär oavsett om man vill jobba i sitt hemland eller internationellt. Med bolag i över 80 länder kan vi erbjuda en spännande utmaning över hela världen.', 0, '019 670 70 00', '', '', '', '', '', 'www.atlascopco.com', 'exhibitor41@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ2d281uI/AoUepITs7qDqaXq.imQNn6yD5ZPzm', 'Jörgen Persson', '1', 0, 1369071762, 0, 0, 1369071762, 0, 'Tillsvidareanställning, Sommarjobb, Praktik, Examensarbete, Inte'),
(754, 'exhibitor42', '', 'Etteplan', '123456-7890', 'Lundalsvägen 37', '123 45', 'Örebro, Hela landet', 'Etteplan', 'Lundalsvägen 37', '123 45', 'Örebro, Hela landet', 'exhibitor42@chartbooker.com', '', 'Sverige', 'Etteplan är specialister inom industritekniska lösningar och teknikinformation. Våra kunder är globala marknadsledare inom fordons-, flyg-, konsument-, medicinteknik-, verkstads-, och energiindustrin. Vi erbjuder en bred kompetens inom utveckling av elektronik och inbyggda system, automation och elkonstruktion, mekanikkonstruktion och teknikinformationstjänster.', 0, '-', '073 274  51 46', '', '', '', '', 'www.etteplan.com', 'exhibitor42@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQe8e92ulPsDaTMO4jEzFrymLPkIOHrjuN0GkES', 'Petra Friberg', '1', 0, 1369071922, 0, 0, 1369071922, 0, 'Tillsvidareanställning, Utlandsmöjligheter'),
(755, 'exhibitor43', '', 'Kriminalvården', '123456-7890', 'Gränsgatan 10', '123 45', 'Örebro', 'Kriminalvården', 'Gränsgatan 10', '123 45', 'Örebro', 'exhibitor43@chartbooker.com', '', 'Sverige', 'Kriminalvårdens uppgift är att genom frivård och fängelser verkställa de påföljder som domstol dömer ut, driva häkten och utföra transporter samt göra personutredningar i brottmål. Verksamheten inriktas på åtgärder som syftar till att påverka den dömde att inte återfalla i brott. Inom myndigheten arbetar flera yrkeskategorier t ex lärare, jurister, sjukvårdspersonal, produktionsledare, utredare etc.', 0, '0772 280 800', '', '', '', '', '', 'www.kriminalvarden.se', 'exhibitor43@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ1e47dO.xsjfBwwsbYugMgXCnu98trn5CpQHby', 'Gunnar Persson', '1', 0, 1369086877, 0, 0, 1369086877, 0, 'Tillsvidareanställning, Extrajobb, Sommarjobb'),
(756, 'exhibitor44', '', 'Nordea', '123456-7890', 'Drottninggatan 12', '123 45', 'Örebro, Hela landet', 'Nordea', 'Drottninggatan 12', '123 45', 'Örebro, Hela landet', 'exhibitor44@chartbooker.com', '', 'Sverige', 'A Great European bank, acknowledged for its people, creating superior value for customers and shareholders ”Everything everybody does in Nordea has one purpose: to create great customer experiences!” - Christian Clausen, President and Group CEO. Nordea is the largest finacial service group in the Nordic and Baltic Sea region11 million customers. Approx 17.000 employees.', 0, '010 435 68 22', '', '', '', '', '', 'www.nordea.se', 'exhibitor44@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQb18fbuhcb6rTb7TwrpOOSPSMt8JUKFaJYHhKm', 'Leif Christensen', '1', 0, 1369087036, 0, 0, 1369087036, 0, 'Tillsvidareanställning, Sommarjobb, Extrajobb, Traineeplats'),
(757, 'exhibitor45', '', 'Spendrups', '123456-7890', 'Storgatan 19', '123 45', 'Grängesberg, Vårby, Hällefors, Visby', 'Spendrups', 'Storgatan 19', '123 45', 'Grängesberg, Vårby, Hällefors, Visby', 'exhibitor45@chartbooker.com', '', 'Sverige', 'Spendrups Bryggeri grundades 1897. Vi är ett bryggeri med ett brett sortiment. Engagemanget och passionen är lika stor nu som då. För oss är alltid hantverket och dryckesupplevelsen i fokus. Familjeföretaget Spendrups är ett svenskt och oberoende bryggeri som förenar starka traditioner med nytänkande. Vi är ca 1000 medarbetare och omsätter ca 3,0 MDKR. I Spendrupskoncernen ingår dotterbolagen Spendrups Vin, Gotlands Bryggeri och Hellefors Bryggeri.', 0, '08 672 79 82', '', '', '', '', '', 'www.spendrups.se', 'exhibitor45@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ1333auskJMqf3z0Vt79RKqzRt5x6DI08w8XJC', 'Malin Ericsson', '1', 0, 1369087344, 0, 0, 1369087344, 0, 'Tillsvidareanställning, Sommarjobb');
