(758, 'exhibitor46', '', 'Örebro Science Park', '123456-7890', 'Forskarvägen 1', '702 18', 'Örebro', 'Örebro Science Park', 'Forskarvägen 1', '702 18', 'Örebro', 'exhibitor46@chartbooker.com', '', 'Sverige', 'Engagera dig i intressanta utvecklingsprojekt med företag, forskare och samhällets aktörer! Var med nätverk\r\natt skapa innovativa produkter, tjänster och metoder! Det är möjligt i Örebro Science Park. Örebro Science Park ska skapa förutsättningar för ett framgångsrikt samarbete mellan företag, forskare och samhällets aktörer. Utgångspunkten för vårt uppdrag är att bidra till tillväxten av den unika kompetens som finns i Örebroregionen inom profilområdena Distribution, Nutrition och Robotik.', 0, '072-521 90 20', '070-6683342', '', '', '', '', 'http://www.orebrosciencepark.se', 'exhibitor46@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ66373uf1g.WdItvsOeBfaSx7qXzlyJapCnzu.', 'Robin Svensson', '1', 0, 1369088434, 0, 0, 1369088434, 0, 'Nätverk'),
