(769, 'Nerthus', '', 'C. Malm', '810714-6642', 'Willengatan 95', '69238', 'Kumla', 'C. Malm', 'Willengatan 95', '69238', 'Kumla', 'insula_sacra@hotmail.com', '', 'Sverge', 'Jag syr kläder och annan textil ex sängkläder i roliga och annorlunda tygmönster, samt målar ex krukor och mindre möbler.', 0, '0720298601', '0720298601', '', '', '', '', '', 'insula_sacra@hotmail.com', '$2a$12$aXQFm.9gR/JCe.HQ4310aOO/Nf5tYOmaLMAxcdz.2vDBORW60gVOe', 'Cecilia Malm', '1', 0, 1370848213, 1370848269, 1, 1375773536, 0, 'hantverk'),
(779, 'multitrolley_esp', '', 'Multi Trolley', '556811-3988', 'NASTAGATAN 2 ', '702 27', 'Örebro ', 'Multi Trolley', 'NASTAGATAN 2 ', '702 27', 'Örebro ', 'multitrolley_esp@chartbooker.com', '', 'Sweden', '<p>Multi Trolley es un galardonado y la invenci&oacute;n patentada para art&iacute;culos tales como escritorios, mesas y camas moverse. El Trolley Multi hace posible que una persona para mover cargas pesadas y voluminosas o art&iacute;culos de mobiliario, todo por themeselves, sin necesidad de una segunda persona para ayudar. Lo que hace que el tranv&iacute;a Multi tan &uacute;nico es su m&eacute;todo de inclinaci&oacute;n patentado y perfectamente equilibrado. El carro est&aacute; bloqueado del lado de lo que sea que quiera transportar, y se inclina entonces a trav&eacute;s de 90 grados y de nuevo sobre sus ruedas. Esto significa que no hay trabajo duro que se requiere Al mover objetos grandes y voluminosos, por lo que el trabajo a mano m&aacute;s seguro y m&aacute;s eficiente.</p>', 0, '019-323227', '', '', '', '', '', '', 'multitrolley_esp@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ7384euedfopz6TWd8eyc4YzJ7Q4I8YGcuyyg6', 'Peder Jensen', '1', 0, 1371412147, 1395062141, 3, 1374573079, 0, 'Multi Trolleys'),
(780, 'aerosoltrap_esp', '', 'AerosolTrap', '556888-1808', 'Forskarvägen 1, Floor 1', '702 18', 'Örebro', 'AerosolTrap', 'Forskarvägen 1, Floor 1', '702 18', 'Örebro', 'aerosoltrap_esp@chartbooker.com', '', 'Sweden', '<p>La revolucionaria tecnolog&iacute;a - Cambiamos el mundo Las oportunidades y &aacute;reas de negocio de todo el &trade;-t&eacute;cnica AerosolTrap son tantos que nosotros mismos no podemos utilizarlos todos. Por lo tanto, hemos optado por centrarse en unas pocas aplicaciones y situaciones que muestra c&oacute;mo funciona la tecnolog&iacute;a. Estos abarcan s&oacute;lo una fracci&oacute;n de los potenciales de alrededor de AerosolTrap &trade;, pero que cambian el mundo paso a paso. Adem&aacute;s de esto tambi&eacute;n nos centramos en la difusi&oacute;n a trav&eacute;s de licencias geogr&aacute;ficamente, empresarialmente, Ciencia y Developement. Esta tecnolog&iacute;a de filtraci&oacute;n y separaci&oacute;n se basa en un principio que no requieren filtros. AerosolTrap &trade; significar&aacute; un cambio de paradigma en el campo de la filtraci&oacute;n, separaci&oacute;n, enriquecimiento y cuestiones similares. Una condici&oacute;n com&uacute;n en la mayor&iacute;a de otras soluciones de filtrado y separaci&oacute;n, las part&iacute;culas m&aacute;s peque&ntilde;as que desea eliminar m&aacute;s energ&iacute;a se requiere para administrar la comisi&oacute;n causada por la ca&iacute;da de presi&oacute;n. AerosolTrap &trade; cumple su funci&oacute;n, en la concentraci&oacute;n de part&iacute;culas contaminantes o enriquecer materias primas con un m&aacute;ximo de eficacia de separaci&oacute;n de 100%, sin aumento de la ca&iacute;da de presi&oacute;n y con un flujo constante. El resultado se puede ver directamente en el bajo consumo de energ&iacute;a y en la calidad de la producci&oacute;n! AerosolTrap &trade; no contiene partes m&oacute;viles por qu&eacute; el mantenimiento se puede cortar a un m&iacute;nimo. Esta t&eacute;cnica est&aacute; patentado en todo el mundo.</p>', 0, '+46706015350', '', '', '', '', '', 'http://www.aerosoltrap.se', 'aerosoltrap_esp@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQcbfceu1cymwSSUR8eawSmH3qrwrWrw6MDKEMe', 'Per-Erik Andersson', '1', 0, 1371412224, 1389043378, 11, 1374573261, 0, 'Filtro y separación soluciones revolucionarias'),
(781, 'onedaywall_esp', '', 'Oneday Wall', '556789-6815', 'FORSKARVÄGEN 1 ', '702 18', 'Örebro', 'Oneday Wall', 'FORSKARVÄGEN 1 ', '702 18', 'Örebro', 'onedaywall_esp@chartbooker.com', '', 'Sweden', 'Misión\r\n\r\nPara una mayor industrialización de la industria de la construcción, estamos desarrollando métodos y conceptos que ofrecemos a los contratistas y productores de materiales de construcción.\r\n\r\nEstos métodos y conceptos que resuelve las necesidades de nuestros clientes para aumentar la eficiencia, mejorar el medio ambiente de trabajo y está en sintonía con un mayor enfoque en la reducción del impacto ambiental.\r\n\r\n\r\nVisión\r\n\r\nSer un líder mundial en el desarrollo de sistemas de paredes racionales para la construcción y crear las condiciones para nuevos productos en construcción - techos, revestimientos, etc', 0, '+4670-6665662', '', '+4670-8890992', '', '', '', 'http://onedaywall.se', 'onedaywall_esp@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ11727u8PyCA02jr4siHoBSiEvZeJEVgCdjnsi', 'Peter Lindberg', '1', 0, 1371412309, 1374573441, 2, 1374573441, 0, 'Click walls'),
(782, 'swedishpharma_esp', '', 'Swedish Pharma', '556745-3070', 'Forskarvägen 1', '702 18', 'Örebro', 'Swedish Pharma', 'Forskarvägen 1', '702 18', 'Örebro', 'swedishpharma_esp@chartbooker.com', '', 'Sweden', 'Sueco Pharma AB es una compañía sueca de propiedad privada fundada en 2007. Nuestra atención se centra en la administración de fármacos transdérmico utilizando una novedosa tecnología de parches bioadhesivo (pendiente de patente). La compañía está desarrollando productos de esta naturaleza con las propiedades únicas de nuestra revisión. Sueco Pharma AB discutirá licencias de su tecnología, y puede ayudar a las empresas interesadas la composición, optimización y diseño aún molecular de moléculas para la mejora de la administración de fármacos. Nuestra compañía puede ayudar en síntesis, las patentes y los ensayos de los nuevos compuestos. Nuestra tecnología de parches ha sido probado en ensayos clínicos y nuestra capacidad de diseño molecular ha dado lugar a un nuevo grupo de sustancias (patente pendiente) para el tratamiento de cáncer de piel. Varias instituciones suecas apoyar financieramente la empresa. Colaboramos con varias empresas e instituciones, tanto en Suecia como en el internacional. Creemos firmemente que nuestro negocio se basa en una tecnología sólida y única y se puede utilizar para una gran variedad de productos.', 0, '+4619 6117050', '+46702920816', '', '', '', '', 'http://www.swedishpharma.com', 'swedishpharma_esp@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQb9556OR3COn7UsTEV1ZtDkqmaOor2XCqTfs6y', 'Lennart Löfgren', '1', 0, 1371412449, 1374573589, 3, 1374573534, 0, 'Bioadhesive patches'),
