(1116, 'memba', '', 'Emma Bergström', 'SE800606660201', 'Laggkärlsvägen 27A', '14159', 'Huddinge', 'Emma Bergström', 'Laggkärlsvägen 27A', '14159', 'Huddinge', 'emma@membadesign.se', 'Sweden', 'Sweden', '<p><strong>MeMbA design</strong>&nbsp;erbjuder hems&ouml;mnad i form av barnkl&auml;der, m&ouml;ssor, olika fodral, nyckelknippor mm. Vi erbjuder &auml;ven exklusiv hemtextil!<br /><strong>www.membadesign.se - Din butik p&aring; n&auml;tet! Vi erbjuder unika och f&auml;rglada textiler och barnkl&auml;der!</strong></p>\r\n<p><br /> <img src="http://i.imgur.com/vmexiMg.png?1" alt="" /></p>', 0, '46707877972', '46707877972', '46707877972', '46707877972', 'emma@membadesign.se', '', 'http://www.membadesign.se', 'emma@membadesign.se', '$2a$12$aXQFm.9gR/JCe.HQ7bcf8OgTxTZ0eibgDiDHB7Zs7vOwhktFP.YS6', 'Emma Bergström', '1', 0, 1377513287, 1395052502, 1, 1395051652, 0, 'Hemsömnad, textil\r\nDin butik på nätet! Vi erbjuder unika och färglada textiler och barnkläder!\r\nwww.membadesign.se\r\n'),
(1119, 'leifeklöf', '', 'HBB Hot Brands Business AB', '556606-5529', 'Fabriksgatan 5', '171 48', 'Solna', 'HBB Hot Brands Business AB', 'Opalgången 9', '135 49', 'Tyresö', 'leif@nyek.se', 'Sweden', 'Sweden', '<p>HBB &auml;r ett importf&ouml;retag som sedan &aring;r 2000 s&aring;lt produkter till grossister och st&ouml;rre detaljistkedjor. HBB har sedan starten specialicerats p&aring; att sj&auml;lva g&ouml;ra godk&auml;nda CE-m&auml;rkningar p&aring; v&aring;ra produkter samt att alltid ha, av EU kommissionen, Kemikalieinspektionen m. fl. myndigheter, godk&auml;nda produkter.</p>\r\n<p>V&aring;rt sortiment best&aring;r av produkter f&ouml;r fritid, resa, h&auml;lsa, fritid, v&auml;lm&aring;ende samt fl&auml;ckborttagnings- och reng&ouml;ringsprodukter fr&aring;n Abnet, Frankrike.</p>', 0, '08910170', '08910170', '0706423140', '0706423140', 'leif@nyek.se', '', 'http://www.hbb.se', 'leif@nyek.se', '$2a$12$aXQFm.9gR/JCe.HQ12c31OeZiQ6ULywjXRApd3Ci9I4L2/NMsCbuC', 'Leif Eklöf', '1', 0, 1377520178, 1377520254, 2, 1377520178, 0, 'HBB säljer produkter för resa, hälsa, fritid, sport, välmående och fläckborttagning/rengöring'),
(1120, 'hundlena', '', 'Örebro Hundrehab', '570109-XXXX', 'Företagsgatan 7', '692 71', 'Kumla', 'Örebro Hundrehab', 'Gräveby 135', '705 93', 'Örebro', 'hundrehab@telia.com', 'Sweden', 'Sweden', '<p><strong>&Ouml;rebro Hundrehab erbjuder Friskv&aring;rd, Elektroterapi, Akupunktur, Stretching.</strong><br />Jag som driver &Ouml;rebro Hundrehab heter Lena Larsson och har arbetat med hundar, uppf&ouml;dning och djursjukv&aring;rd i &ouml;ver 30 &aring;r. <br />Jag &auml;r v&auml;lutbildad, erfaren och certifierad/diplomerad inom de flesta fysioterapeutiska omr&aring;den vad g&auml;ller hundar och deras problematik. <br />P&aring; fritiden &auml;r jag aktiv inom brukshundklubben samt domare inom IPO-sporten.<br /><em>Hos &Ouml;rebro Hundrehab f&aring;r ni alltid korrekt bem&ouml;tande och professionell hj&auml;lp.</em> <br />V&auml;lkommen!</p>', 0, '070-6667846', '070-6667846', '', '070-6667846', 'hundrehab@telia.com', '', 'www.orebrohundrehab.se', 'hundrehab@telia.com', '$2a$12$aXQFm.9gR/JCe.HQ4eabcuz4m/eoeHghxc4lEJ9n/zNGVJhkM604a', 'Lena Larsson', '1', 0, 1377540608, 0, 0, 1377540608, 0, 'Professionell rehabilitering och friskvård för din hund och katt.'),
