(1145, 'moimarknad.se', '', 'Moimarknad', '820430-0837', 'Midgårdsvägen 2', '51254', 'Svenljunga', 'Moimarknad', 'Midgårdsvägen 2', '51254', 'Svenljunga', 'info@moimarknad.se', 'Sweden', 'Sweden', '<h1><strong>Din mobilskal expert</strong></h1>\r\n<h1><strong>Vi &auml;r experten p&aring; mobilskal, vi har till 95% av alla mobiltelefon modeller, vi har &auml;ven ipad och tablet fodral samt pl&aring;nb&ouml;cker till olika mobiltelefoner. Det vi inte har i butiken tar vi hem till er.</strong><br /><strong>Hos oss kan du &auml;ven designa ditt eget mobilskal, din egen favorit bild eller text p&aring; ditt mobilskal. Bara fantasin s&auml;tter gr&auml;nserna.</strong><br /><strong>Vi levererar allt fraktfritt.</strong></h1>\r\n<p>&nbsp;</p>', 0, '0703-53 19 34', '0703-53 19 34', '0764-11 35 31', '0703-53 19 34', 'david@moimarknad.se', '', 'http://www.moimarknad.se', 'info@moimarknad.se', '$2a$12$aXQFm.9gR/JCe.HQdaf4bOc7on7gaEOR3rCalBSkJqGHP6AT.6Ewy', 'David', '1', 0, 1378398369, 0, 0, 1378398369, 0, 'Tryckér direkt på mobilskal\r\nDin bild på mobilskal'),
