(1150, 'Jonny/åsa', '', 'Krantz Grisar ', '7009102513', 'Brahegatan', '56332 ', 'Gänna', 'jonnysdiversehandel', 'vondübensväg 10', '56331', 'Gränna', 'jonnysdiversehandel@telia.com', 'Sweden', 'Sweden', '<p>Vi &auml;r ett familje f&ouml;retag som har egen tillverkning av Polkagrisar i Gr&auml;nna. V&aring;r inriktning &auml;r f&ouml;rs&auml;ljning till turister d&aring; vi har butik i Gr&auml;nna men &auml;ven tillverkning till butiker,kiosker,marknader. Vi s&auml;ljer &auml;ven till skolor/f&ouml;reningar s&aring; de i sin tur kan s&auml;lja &aring; ut&ouml;ka skol/f&ouml;reningskassan p&aring; ett mycket enkelt &aring; uppskatat vis. G&aring; in p&aring; v&aring;r hemsida f&ouml;r mer info <strong><span style="text-decoration: underline;">www.krantzgrisar.se</span></strong> eller maila oss <span style="text-decoration: underline;"><strong>info@krantzgrisar.se</strong></span></p>\r\n<p><span style="text-decoration: underline;"><strong>&nbsp;</strong></span></p>\r\n<p>P&aring; Sannamarken kommer vi &auml;ven ha Gr&auml;nna kn&auml;ckebr&ouml;d &aring; must fr&aring;n lokala lev, vi kommer ocks&aring; ha en bagare som var med i vm i Polkagrisbakning till bakningen av Polkagrisarna (vilket vi kommer att g&ouml;ra p&aring; Sannamarken om v&auml;dret &auml;r med oss). En tjej som endast &auml;r 14 &aring;r och &auml;r v&aring;r dotter. En ny liten Amalia som hon hette vars uppfann Polkagrisen 1856.&nbsp;</p>', 0, '0390-10333', '0390-10333', '0736-730831', '0736-730831', 'jonnysdiversehandel@telia.com', '', 'http://www.krantzgrisar.se', 'jonnykrantz@telia.com', '$2a$12$aXQFm.9gR/JCe.HQ5451cOtvBhdXZoijbxJwTQDZztAg6m6tFX.lS', 'jonny', '1', 0, 1378976614, 1379414754, 2, 1378976614, 0, 'Polkagrisar och bakning av polkagrisar om väder tillåter. Även Gränna knäckebröd å must mm från lokala förmågor. '),
