(1160, 'emmaaskeblad', '', 'US & Asia Trading', '969751-5790', 'skjutbanevägen 1', '703 69', 'Örebro', 'US & Asia Trading', 'skjutbanevägen 1', '703 69', 'Örebro', 'thomas.datel@gmail.com', 'Sweden', 'Sweden', '<p>F&ouml;retaget US &amp; Asia Trading (UAT) &auml;r ett import f&ouml;retag som startades 2010 av<br />Mattias Leijon och Thomas Askeblad. Vi importerar produkter fr&aring;n framf&ouml;rallt USA och Asien.F&ouml;retaget US &amp; Asia Trading (UAT) &auml;r ett import f&ouml;retag som startades 2010 av<br />Mattias Leijon och Thomas Askeblad. Vi importerar produkter fr&aring;n framf&ouml;rallt USA och Asien.</p>', 0, '0702105139', '0738306541', '', '0738306541', 'thomas.datel@gmail.com', '', 'http://www.uat.se', 'thomas.datel@gmail.com', '$2a$12$aXQFm.9gR/JCe.HQc92e3ueqmVZEtxbH2cQ5VacdD0A5F1HPiB/LS', 'Emma Askeblad', '1', 0, 1379352983, 0, 0, 1379352983, 0, 'Vi erbjuder olika importvaror allt från tex hundhalsband till mobiltillbehör. '),
(1161, 'Gordonbusinesscenterltd', '', 'Gordon business center LTD', '08610046', 'Riggargatan 28D ', '80286', 'Gävle ', 'Gordon business center LTD', 'Riggargatan 28D ', '80286', 'Gävle ', 'Gordon.business.center@live.se', 'Sweden', 'Sweden', '', 0, '076-5557848', '0722735044', '0722735044', '076-5557848', 'gordon.business.center@live.se', '', 'http://www.expertisgruppen.se', 'Gordon.business.center@live.se', '$2a$12$aXQFm.9gR/JCe.HQ14ecdustJ5Q9Y/xPZtPgwhLOBSRnyi32PhS5W', 'Kristoffer Sjöberg', '1', 0, 1379360898, 0, 0, 1379360898, 1, 'Mobilskal + mobilplånböcker till iphone, samsung, Nokia, sony, HTC, Alcatel med fler modeller och märken. '),
(1162, 'Får', '', 'Bredsjö Mjölkfår AB', '5562973908', 'Bredsjö 106', '71291', 'Hällefors', 'Bredsjö Mjölkfår AB', 'Bredsjö 106', '71291', 'Hällefors', 'johan.alven@documentarygroup.se', 'Sweden', 'Sweden', '<p>Bredsj&ouml; Bl&aring;</p>\r\n<p>Osten produceras av egen f&aring;rmj&ouml;lk med Roquefortem&ouml;gel. Osten &auml;r pasteuriserad och lagras ca &frac12; och 1 &aring;r. Fylligheten och rundheten &ouml;kar med &aring;ldern. I yngre ostar &auml;r m&ouml;gelsmaken oftast mer framtr&auml;dande, f&ouml;r att sedan balanseras med smak av lagrad ost och kittp&aring;verkan fr&aring;n ytan med stigande &aring;lder.</p>\r\n<p>Det &auml;r hela tiden variationer mellan ystningarna eftersom vi g&ouml;r den helt hantverksm&auml;ssigt. Det &auml;r mycket som p&aring;verkar; ens egen sinnesst&auml;mning, tiden p&aring; &aring;ret, sp&auml;nningar i luften (&aring;ska v&auml;nder upp och ned p&aring; det mesta). Mj&ouml;lken varierar under &aring;ret eftersom f&aring;ren lammar ganska samlat under v&aring;rvintern. Mj&ouml;lken ligger i b&ouml;rjan p&aring; ca 4% fett- och proteinhalt och stiger successivt under sommaren till 8-10%. Detta p&aring;verkar osten mycket.</p>', 0, '00468761020', '0046705410999', '', '', 'johan.alven@documentarygroup.se', '', '', 'johan.alven@documentarygroup.se', '$2a$12$aXQFm.9gR/JCe.HQ74c7duM5wu/K/XwUNJ5ilijFr833UveG3kreu', 'Johan Alvén', '1', 0, 1379430391, 0, 0, 1379430391, 0, 'Cheese and DVD'),
(1163, 'PACARINA', '', 'SPIRIT', '9203731485', 'MYCKELMOSSA SAG', '61691', 'NORRKOPING', 'SPIRIT', 'MYCKELMOSSA SAG', '616 91  ABY, SIM', 'NORRKOPING', 'daikydavid@gmail.com', 'Sweden', 'Sweden', '<p>HELLO MY NAME IS PACARINA SANTILLAN, I SPOKED WITH YOU THIS MORNING, I NEED 6 METERS, SEND ME YOUR ANSWER TO MY MAIL, THANK YOU</p>\r\n<p>HAVE A NICE DAY</p>', 0, '0761590239', '0761590239', '', '', 'daikydavid@gmail.com', '', '', 'daikydavid@gmail.com', '$2a$12$aXQFm.9gR/JCe.HQ5efa1u7d5Zml51oMPXk7FeN/DSsx3JFJ4.jhe', 'PACARINA', '1', 0, 1379446646, 1379531438, 1, 1379531254, 0, 'CUADROS DE INDIOS EN 3D, PONCHOS, CHAQUETAS DE LANA, GORRAS DE LANA HECHAS A MANO, PULSERAS, PANTALONES, SHORTS PARA NINOS, JUGUETES, SOMBREROS, CAMISETAS DE INDIO, ETC...'),
(1164, 'pinkyepe', '', 'INCAICO IMPORT', '3023114048', 'MICKELMOSSA SÁG ', '61691 ÁBY', 'SIMONSTORP', 'INCAICO IMPORT', 'MICKELMOSSA SÁG ', '61691 ÁBY', 'SIMONSTORP', 'elsy1981@hotmail.com', 'Sweden', 'Sweden', '', 0, '0769738638', '0769738638', '', '0769738638', 'elsy1981@hotmail.com', '', '', 'elsy1981@hotmail.com', '$2a$12$aXQFm.9gR/JCe.HQ6f6d4Ox83t7cFfTQuENKg.0kidpOWBnjBJnMq', 'ELSA SANTILLAN', '1', 0, 1379447947, 0, 0, 1379447947, 0, 'PONCHOS,,CHAQUETAS DE LANA ,ATRAPASUEÑOS,,VISUTERIA ETC'),
(1165, 'Efrain', '', 'Efrain Import', '8211069177', 'Ätravägen 11 2tr', '12841 Bagarmosse', 'Stockholm', 'Efrain Import', 'Ätravägen 11 2tr', '12841 Bagarmosse', 'Stockholm', 'efrainpaucarchuco@gmail.com', 'Sweden', 'Sweden', '', 0, '0734164625', '0734164625', '', '', 'efrainpaucarchuco@gmail.com', '', '', 'efrainpaucarchuco@gmail.com', '$2a$12$aXQFm.9gR/JCe.HQfe4d6uw/AL/EP2JFbIE5d.ojYSxqHkcPSWOoq', 'Efrain Paucarchuco', '1', 0, 1379485744, 1379657403, 2, 1379657403, 0, 'Smycken, kepsar'),
(1166, 'Johan_alven', '', 'Nostalgifilm', '7696220560', 'Nygatan 20 a', '70211', 'Örebro', 'Nostalgifilm', 'Nygatan 20 a', '70211', 'Örebro', 'johan@nostalgifilm.se', 'Sweden', 'Sweden', '<p>Det b&ouml;rjade med att vi gjorde en nostalgifilm om V&auml;ster&aring;s p&aring; 50- och 60-talet f&ouml;r V&auml;stmanlands L&auml;ns Tidningar (VLT). Filmen byggde p&aring; VLTs eget fotoarkiv och denna gavs ut p&aring; DVD f&ouml;r att s&auml;ljas till fr&auml;mst VLT&acute;s l&auml;sare. Filmen visade sig vara en succ&eacute; och s&aring;ldes i flera tusen exemplar.</p>\r\n<p>&Aring;ret efter testade vi konceptet &auml;nnu mer lokalt; i H&auml;llefors. Genomsvaret blev enormt &ndash; f&ouml;rsta nostalgifilmen s&aring;ldes i 3000 exemplar i en kommun med ca 7700 inv&aring;nare!</p>\r\n<p>D&auml;refter har vi &ouml;kat produktionen &aring;r f&ouml;r &aring;r och idag &auml;r vi uppe i runt 25 nostalgifilmer! Det har blivit titlar fr&aring;n m&aring;nga olika kommuner som Lindesberg, Kumla, H&auml;llefors, Loka Brunn, Hagfors och Degerfors m. fl. Flera av orterna har dessutom f&aring;tt flera decennier dokumenterade.</p>\r\n<p>2011 utvecklade vi till att producera en nationell nostalgifilm - "Skog &amp; Skogsbruk under 1900-talet i svenska skogsl&auml;n". Den har blivit v&aring;r st&ouml;rsta f&ouml;rs&auml;ljningsframg&aring;ng hittills. 2013 har den nationella "Lant- &amp; jordbruk under 1900-talet i svenska l&auml;n" producerats.</p>\r\n<p>Varje produktion har skett i samarbete med kommunerna och det lokala n&auml;ringslivet samt organisationer, som LRF.</p>', 0, '0046-70-5410999', '0046705410999', '', '', 'johan@nostalgifilm.se', '', 'http://www.nostalgifilm.se', 'johan@nostalgifilm.se', '$2a$12$aXQFm.9gR/JCe.HQ0c1b4O59ImomUlnDCO5UPNktjUqT7gUMD0T2K', 'Johan Alvén', '1', 0, 1379487262, 0, 0, 1379487262, 1, 'Nostalgifilmer i DVD-format'),
(1167, 'krösa', '', 'Krösa-Stinas Vilda Skafferi', '570516-2401', 'Rumma Stora Jansbo', '59492', 'Gamleby', 'Krösa-Stinas Vilda Skafferi', 'Rumma Stora Jansbo', '59492', 'Gamleby', 'crehn@hotmail.com', 'Sweden', 'Sweden', '', 0, '070-6005643', '070-6005643', '', '', 'crehn@hotmail.com', '', '', 'crehn@hotmail.com', '$2a$12$aXQFm.9gR/JCe.HQf9592OqTGUWAn5TwTdEIkbra8dgHgcWrOqgnW', 'Christina Rehn', '1', 0, 1379499993, 0, 0, 1379499993, 0, 'Rökt viltkorv, rökt kött samt rårörda lingon.'),
(1168, 'nidingbane', '', 'Nidingbane', '6805186639', 'Rostagatan 16', '703 41', 'Örebro', 'Nidingbane', 'Rostagatan 16', '703 41', 'Örebro', 'nidingbane@hotmail.com', 'Sweden', 'Sweden', '<p>Om Nidingbane.</p>\r\n<p>Nidingbane &auml;r en del av f&ouml;retaget Brutala blommor som har funnits i ca 7 &aring;r. Vi reser runt stora delar av &aring;ret och medverkar p&aring; marknader samt m&auml;ssor f&ouml;r att visa upp och s&auml;lja historiska saker. Turn&eacute;lista.</p>\r\n<p>Vi har v&aring;r fysiska butik i &Ouml;rebro p&aring; Rostagatan 14 . Vi tillverkar &auml;ven eget l&auml;derhantverk p&aring; plats.<br />Flera g&aring;nger om &aring;ret s&aring; reser vi runt i Europa f&ouml;r att bes&ouml;ka smeder och testa olika kvalit&eacute;er p&aring; rustningar och vapen.</p>\r\n<p>Vi f&aring;r ofta specialbest&auml;llningar fr&aring;n t.ex museum eller TV-inspelningar, och f&ouml;r dessa, samt f&ouml;r vanliga kunder har vi v&auml;ldigt snabba leveranstider.</p>\r\n<p>Har du en bild eller en teckning p&aring; vapen, rustning eller i stort sett n&auml;stan vad som helst s&aring; kan vi ordna fram det mesta.<br /><br /></p>\r\n<p>Bes&ouml;k v&aring;r hemsida http://www.nidingbane.se</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 0, '0704782480', '0704782480', '', '0704782480', 'nidingbane@hotmail.com', '', 'http://www.nidingbane.se', 'nidingbane@hotmail.com', '$2a$12$aXQFm.9gR/JCe.HQ4c809um6XX0XTkcteKyB8WdyF5iNSOQ3.d1MK', 'Dick Oskarsson', '1', 0, 1379504317, 1392893000, 2, 1392892976, 0, 'Smide, medeltida rustningar, historiskt hantverk.'),
(1169, 'backastudios', '', 'Backa Studios', '969727-0297', 'Backa 122', '711 92', 'Vedevåg', 'Backa Studios', 'Backa 122', '711 92', 'Vedevåg', 'johnny@backastudios.se', 'Sweden', 'Sweden', '<p>Backa Studios producerar film och reklam i &Ouml;rebro l&auml;n f&ouml;r den svenska och internationella marknaden. Ni kan oavsett omfattning och krav f&aring; hj&auml;lp med att ta fram de l&ouml;sningar ni beh&ouml;ver f&ouml;r att p&aring; b&auml;sta s&auml;tt lyfta ert f&ouml;retag, er f&ouml;rening eller era produkter. V&aring;r erfarenhet och bredd g&ouml;r att vi kan leverera inom de flesta medier och ta fram l&ouml;sningar i allt fr&aring;n ren spelfilmsproduktion, reklam, animering, utbildning, 3D till foto, trycksaker och mobilapplikationer.</p>', 0, '+46 704 04 88 44', '+46 704 04 88 44', '', '+46 704 04 88 44', 'johnny@backastudios.se', '', 'http://www.backastudios.se', 'johnny@backastudios.se', '$2a$12$aXQFm.9gR/JCe.HQ14159eseOOpzm1SLajd.sIX08RgGR/tP5a6rG', 'Johnny Wernersson', '1', 0, 1379512345, 1379512557, 1, 1379512345, 0, 'Producering av film och reklam i Örebro län för den svenska och internationella marknaden. '),
(1170, 'boom', '', 'Arons Import La Boom AB', '556587-2941', 'Drottninggatan 20', '702 10', 'Örebro', 'Arons Import La Boom AB', 'Drottninggatan 20', '702 10', 'Örebro', 'parvezpojje@hotmail.com', 'Sweden', 'Sweden', '<p>La Boom &auml;r ett av &Ouml;rebros mest etablerade och popul&auml;ra mode-och kl&auml;desbutiker. Hos oss finner ni alltid de vackra plaggen till bra priser. V&auml;lkomna till La Boom AB p&aring; Drottninggatan 20.</p>', 0, '070-9605565', '070-9605565', '019-184125', '070-9605565', 'parvezpojje@hotmail.com', '', '', 'parvezpojje@hotmail.com', '$2a$12$aXQFm.9gR/JCe.HQ65079O6wFbcxiTvAR4jop5qLrCLIi4dyV5in2', 'Aron Sheikh', '1', 0, 1379518607, 0, 0, 1379518607, 0, 'Kläder för mode och fritid.'),
(1171, 'berglunda', '', 'Örebro Ventilation & Värme AB', '556791-7116', 'Berglundavägen 11', '702 36', 'Örebro', 'Örebro Ventilation & Värme AB', 'Berglundavägen 11', '702 36', 'Örebro', 'mats@orebrovv.se', 'Sweden', 'Sweden', '<p><strong>Service, Kontroll, V&auml;rmepumpar - Ring&nbsp;Mats Berglind 070-2244788</strong></p>\r\n<p><strong>N&auml;r bytte ni era filter sist?</strong><br />(En f&ouml;ruts&auml;ttning f&ouml;r att anl&auml;ggningen skall kunna fungera optimalt.)<br />Givetvis kan vi ombes&ouml;rja ett filterbyte, injustering och OVK-kontroll av er ventilationsanl&auml;ggning.<br />Vill ni ha en &auml;nnu bekv&auml;mare l&ouml;sning, kan vi erbjuda er ett serviceavtal p&aring; er anl&auml;ggning.<br />Vi utf&ouml;r &auml;ven helt nyinstallationer av ventilationsanl&auml;ggningar.</p>\r\n<p><strong>Luftv&auml;rmepumpar</strong><br />Vi har ett m&aring;ng&aring;rigt samarbete med Daikin luftv&auml;rmepumpar.<br />Visste ni att ni kan spara 50% av er uppv&auml;rmningskostnad genom att installera en luftv&auml;rmepump.<br />Ni kan &auml;ven f&aring; ROT-avdrag p&aring; upp till 50% av arbetskostnaden vid nyinstallation av en luftv&auml;rmepump.<br />Vi kan &auml;ven utf&ouml;ra service p&aring; er gamla luftv&auml;rmepump.</p>\r\n<p><strong>Fels&ouml;kning</strong><br />Fungerar er anl&auml;ggning d&aring;ligt, oj&auml;mn v&auml;rme, d&aring;lig luft, h&ouml;gljudda ventilationsljud?<br />Tveka inte p&aring; att kontakta oss f&ouml;r att f&aring; hj&auml;lp med fels&ouml;kning.</p>\r\n<p><strong>Har ni fj&auml;rrv&auml;rme i er fastighet? </strong>Vi har stor erfarenhet av nyinstallation och &auml;ven fels&ouml;kning och reparation av er befintliga anl&auml;ggning.</p>\r\n<p>&nbsp;</p>', 0, '019-123420', '070-2244788', '070-2244788', '070-2244788', 'mats@orebrovv.se', '', 'www.orebrovv.se', 'mats@orebrovv.se', '$2a$12$aXQFm.9gR/JCe.HQe5f8fuNSReKdMC3/SreQsiLCPlkRA.nDbaYK2', 'Mats Berglind', '1', 0, 1379602465, 0, 0, 1379602465, 0, 'Luftvärmepumpar Daikin. \r\n