(1317, 'Tivoli2014', '', 'Peter Bergströms Tivoli AB', 'se556694283401', 'Box 85', '63102', 'Eskilstuna', 'Peter Bergströms Tivoli AB', 'Box 85', '63102', 'Eskilstuna', 'kontor@bergstromstivoli.se', 'Sweden', 'Sweden', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;<a href="http://bergstromstivoli.com" target="_blank"><img src="http://i.imgur.com/HMn3Q8b.jpg" alt="" width="280" height="200" /></a></p>\r\n<p>Som arrang&ouml;r ska ni veta att vi kan vara er samarbetsparter, b&aring;de f&ouml;r ett stort arrangemang eller f&ouml;r ett litet, f&ouml;r inget &auml;r f&ouml;r litet eller f&ouml;r stort vi har m&ouml;jlighet att anpassa storleken p&aring; tivolit f&ouml;r ditt arrangemangs behov.</p>\r\n<p>&Auml;r du bes&ouml;kare eller arrang&ouml;r s&aring; ska du veta att vi g&ouml;r allt f&ouml;r att alla ska k&auml;nna sig trygga och s&auml;kra med bes&ouml;ket hos oss. Vi arbetar st&auml;ndigt med att s&auml;tta s&auml;kerheten och kvalit&eacute;n i f&ouml;rsta hand.</p>\r\n<p>V&aring;rt material blir besiktigat varje &aring;r av b&aring;de Det Norske Veritas i Norge och av Inspecta i Sverige.</p>\r\n<p>Vi har f&ouml;retags- och ansvarsf&ouml;rs&auml;kring genom &Aring;lands &ouml;msesidiga f&ouml;rs&auml;kringsbolag.</p>\r\n<p>Vi &auml;r medlem i Norsk Cirkus och Tivolieierforening och i Sveriges Tivoli&auml;garef&ouml;rening.</p>', 0, '+4616511282', '+4791878876', '+4795078474', '+4791878876', 'jb@bergstromstivoli.se', '', 'http://www.bergstromstivoli.se', 'kontor@bergstromstivoli.se', '$2a$12$aXQFm.9gR/JCe.HQaab4euX0A.XI3ghZ2MELxmBiWIG5Y11q5GC9q', 'Jan Bergström', '1', 0, 1394090119, 1394721277, 3, 1394090119, 0, 'Ambulerande Tivoliverksamhet'),
