(1374, 'Doge', '', 'Doge', 'Doge', 'Doge', 'Doge', 'Doge', 'Doge', 'Doge', 'Doge', 'Doge', 'doge@chartbooker.com', 'Afghanistan', 'Afghanistan', '<div>\r\n<div class="wsite-multicol">\r\n<div class="wsite-multicol-table-wrap" style="margin: 0 -15px;">\r\n<table class="wsite-multicol-table">\r\n<tbody class="wsite-multicol-tbody">\r\n<tr class="wsite-multicol-tr">\r\n<td class="wsite-multicol-col" style="width: 33.333333333333%; padding: 0 15px;">\r\n<div class="paragraph" style="text-align: left;"><span style="color: #2a2a2a; font-size: x-large;">About us</span></div>\r\n<div>\r\n<div class="wsite-image wsite-image-border-thin " style="padding-top: 10px; padding-bottom: 10px; margin-left: 0; margin-right: 0; text-align: left;"><a> <img style="width: 100%; max-width: 271px;" src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__9523915_orig.jpg" alt="Picture" /> </a>\r\n<div style="display: block; font-size: 90%;">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class="paragraph" style="text-align: left;"><span style="color: #2a2a2a; font-size: medium;">Chartbooker International AB&trade; was founded in the year 2011 by the multi entrepreneurs Susana Herbozo and Leif Wall&eacute;n.<br /><br /> Chartbooker International AB&trade; was in 2011 selected as an affiliate to INKUBERA.<br /> INKUBERA is dedicated to aid the development of young swedish companies that have innovative products, ideas and an extremely high potential for international affairs.<br /><br /> Our headquarters is stationary at the mansion Holms&auml;ters G&aring;rd. Our business office is situated in Net City at the &Ouml;rebro Science Arena.<br /><br /> We are proud to have created the Chartbooker Fair System&trade;, a visionary and unique product highly important for the whole world trade.<br /></span></div>\r\n</td>\r\n<td class="wsite-multicol-col" style="width: 33.333333333333%; padding: 0 15px;">\r\n<div class="paragraph" style="text-align: left;"><span style="color: #2a2a2a; font-size: x-large;">Global need</span></div>\r\n<div>\r\n<div class="wsite-image wsite-image-border-thin " style="padding-top: 10px; padding-bottom: 10px; margin-left: 0; margin-right: 0; text-align: left;"><a> <img style="width: 100%; max-width: 271px;" src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__7801593_orig.jpg" alt="Picture" /> </a>\r\n<div style="display: block; font-size: 90%;">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class="paragraph" style="text-align: left;"><span style="color: #2a2a2a; font-size: medium;">The booking process regarding fairs and events hasn''t evolved much the last thirty years.&nbsp;<br /> It is a long-spun, aged process that is in a high need of mordenization.<br /><br /> <strong>New, unique global solution</strong><br /> The Chartbooker Fair System&trade; is a system adapted to solve many of the shortcomings in the planning and administrating of today&rsquo;s global fairs and events. Organizers, staff, exhibitors, visitors and mass media over the whole world can from now on use the same tool to make the most out their own part in an event.<br /><br />Read about Chartbooker Fair System at our web page below.</span></div>\r\n</td>\r\n<td class="wsite-multicol-col" style="width: 33.333333333333%; padding: 0 15px;">\r\n<div class="paragraph" style="text-align: left;"><span style="color: #2a2a2a; font-size: x-large;">Goals</span></div>\r\n<div>\r\n<div class="wsite-image wsite-image-border-thin " style="padding-top: 10px; padding-bottom: 10px; margin-left: 0; margin-right: 0; text-align: left;"><a> <img style="width: 100%; max-width: 271px;" src="http://www.chartbooker.com/uploads/1/7/4/9/17497065/__7239112_orig.jpg" alt="Picture" /> </a>\r\n<div style="display: block; font-size: 90%;">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class="paragraph" style="text-align: left;"><span style="color: #2a2a2a; font-size: medium;"><strong>Worldwide</strong><br /> Chartbooker International AB plan to have a worldwide&nbsp;dominating position in its line of business.<br /> Global establishment of our platform will also set a global standard regarding virtual and interactive booking systems.<br /> We will keep this position through close cooperation with our customers and steady development in other countries.<br /> <br /> <strong>The work</strong><br /> Visionary and continuously product development with competent co-workers and high service standard. We shall foresee and effectivly meet new demands and needs.<br /><br /> <strong>New establishments</strong><br /> We also intend to establish systems in other kind of business activities.&nbsp;<br /></span></div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>', 0, 'Doge', 'Doge', 'Doge', 'Doge', 'doge@chartbooker.com', 'Doge', 'http:// ', 'doge@chartbooker.com', '$2a$12$aXQFm.9gR/JCe.HQ136deuUeQ8Mf9sCV/De5PQx2w7NrNQzHVTB6y', 'Doge', '1', 0, 1395817631, 1395822637, 2, 1395817631, 0, 'Doge'),
